tory in one place.'=>'Безпечно приймайте кредитні та дебетові картки з однією низькою ставкою, без несподіваних комісій (доступні індивідуальні ставки). Продавайте в магазині та відстежуйте продажі та запаси в одному місці.','Enable PayU\'s exclusive plugin for WooCommerce to start accepting payments in 100+ payment methods available in India including credit cards, debit cards, UPI, & more!'=>'Увімкніть ексклюзивний плагін PayU для WooCommerce, щоб почати приймати платежі більш ніж 100 способами оплати, доступними у вашій країні, включаючи кредитні картки, дебетові картки, UPI та багато іншого!','Payoneer Checkout is the next generation of payment processing platforms, giving merchants around the world the solutions and direction they need to succeed in today\'s hyper-competitive global market.'=>'Payoneer Checkout - це платформа обробки платежів наступного покоління, що надає продавцям по всьому світу рішення та напрямки, необхідні їм для досягнення успіху на сучасному гіперконкурентному глобальному ринку.','Credit/debit cards, Apple Pay, Google Pay, and more.'=>'Кредитні/дебетові картки, Apple Pay, Google Pay тощо.','Viva.com Smart Checkout'=>'Розумна каса Viva.com','A European payments solution that allows you to accept payments in over 25 countries and multiple currencies.'=>'Європейське платіжне рішення, яке дозволяє приймати платежі в більш ніж 25 країнах і декількох валютах.','Paymob'=>'Paymob','Safe and secure payments using your customer\'s PayPal account.'=>'Надійні та безпечні платежі за допомогою PayPal.','PayPal Payments lets you offer PayPal, Venmo (US only), Pay Later options and more.'=>'PayPal Payments дає можливість пропонувати клієнтам різні варіанти оплати: PayPal, Venmo (тільки в США), Pay Later тощо.','Paymob is a leading payment gateway in the Middle East and Africa. Accept payments online and in-store with Paymob.'=>'Paymob - провідний платіжний шлюз на Близькому Сході та в Африці. Приймайте платежі онлайн та в магазинах за допомогою Paymob.','The Payfast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa\'s most popular payment gateways. No setup fees or monthly subscription costs. Selecting this extension will configure your store to use South African rands as the selected currency.'=>'Розширення Payfast для WooCommerce дозволяє приймати платежі по кредитній карті та шляхом безготівкових переказів через один з найпопулярніших платіжних шлюзів в Південній Африці. Вам не потрібно буде платити за встановлення або щомісяця оплачувати підписку. При виборі цього розширення в якості валюти в магазині буде використовуватися Південноафриканський ранд.','Antom'=>'Antom','Your trusted payments partner in Asia and around the world.'=>'Ваш надійний платіжний партнер в Азії та в усьому світі.','The category of the suggestion.'=>'Категорія пропозиції.','The tags associated with the suggestion.'=>'Теги, пов’язані з пропозицією.','The URL of the icon (square aspect ratio).'=>'URL-адреса іконки (квадратне співвідношення сторін).','The URL of the image.'=>'URL-адреса зображення.','The description of the suggestion.'=>'Опис пропозиції.','The title of the suggestion.'=>'Назва пропозиції.','The type of the suggestion.'=>'Тип пропозиції.','The priority of the suggestion.'=>'Пріоритет пропозиції.','The unique identifier for the suggestion.'=>'Унікальний ідентифікатор пропозиції.','A suggestion with full details.'=>'Пропозиція з усіма деталями.','The URL to hide the suggestion.'=>'URL-адреса, щоб приховати пропозицію.','The link to hide the suggestion.'=>'Посилання, щоб приховати пропозицію.','The suggestion ID matching this provider.'=>'ID пропозиції, що відповідає цьому постачальнику.','Tag associated with the provider.'=>'Тег, пов\'язаний з провайдером.','The tags associated with the provider.'=>'Теги, пов’язані з постачальником.','The URL of the payment method icon or a base64-encoded SVG image.'=>'URL іконки способу оплати або SVG-зображення в кодуванні base64.','The 