r values representing the sort order.'=>'Відображення ідентифікатора постачальника в цілих значеннях, що представляють порядок сортування.','ISO3166 alpha-2 country code. Defaults to WooCommerce\'s base location country.'=>'Код країни в системі ISO3166 alpha-2. За замовчуванням використовується країна основного розташування WooCommerce.','The ISO3166 alpha-2 country code to save for the current user.'=>'Код країни ISO3166 alpha-2 поточного користувача, який слід зберегти.','A payment provider in the context of the main Payments Settings page list.'=>'Постачальник платіжних послуг у контексті основного списку сторінок "Налаштування платежів".','The corresponding plugin details of the provider.'=>'Відомості про постачальника плагіна.','Address Line 2'=>'Адреса, рядок 2','Phone number'=>'Номер телефону','Take offline payments'=>'Приймайте офлайн-платежі','Give your shoppers additional ways to pay.'=>'Надайте своїм покупцям додаткові способи оплати.','Payment Providers'=>'Платіжні системи','Offer flexible payment options to your shoppers.'=>'Запропонуйте покупцям широкі можливості для оплати покупок.','Buy Now, Pay Later'=>'Купуй зараз, плати пізніше','Allow shoppers to fast-track the checkout process with express options like Apple Pay and Google Pay.'=>'Надайте покупцям можливість прискорити процес оформлення замовлення за допомогою експрес-опцій, таких як Apple Pay та Google Pay.','Invalid suggestion ID.'=>'Недійсний ідентифікатор пропозиції.','Transient saved for key %s.'=>'Збережено транзит ключа %s.','Error saving transient. Please try again.'=>'Помилка при збереженні транзиту. Будь ласка, спробуйте ще раз.','Error sending test email. Please try again.'=>'Помилка надсилання тестового листа. Будь ласка, спробуйте ще раз.','Test email sent to %s.'=>'Тестовий електронний лист надіслано на адресу %s.','Controls the display of the apartment (address_2) field in checkout.'=>'Тут має відображатися номер квартири (address_2) під час оформлення замовлення.','Controls the d