levate your table with a 330ml Retro Glass Jug, blending classic design and durable hardened glass.'=>'Прикрасьте свій стіл скляним глечиком "Ретро" ємністю 330 мл, що поєднує в собі класичний дизайн та міцне загартоване скло.','Handmade gifts'=>'Подарунки ручної роботи','Retro photography'=>'Ретро фотографія','Up to 60% off'=>'Знижка до 60%','Holiday Sale'=>'Святковий розпродаж','Get your favorite vinyl at record-breaking prices.'=>'Отримайте свою улюблену платівку за зниженою ціною.','Home decor'=>'Домашній декор','Shop vinyl records'=>'Магазин вінілових платівок','Inbox notification has been deleted'=>'Сповіщення видалено','Inbox notification not found'=>'Сповіщення не знайдено','No inbox notification selected'=>'Не вибрано жодного сповіщення','Search for an inbox notification&hellip;'=>'Пошук сповіщення&hellip;','Select an inbox notification to delete:'=>'Виберіть сповіщення, яке потрібно видалити:','Delete an Inbox Notification'=>'Видалити сповіщення','Refresh Remote Inbox Notifications'=>'Оновити давніші вхідні сповіщення','This will refresh the remote inbox notifications'=>'Давніші сповіщення будуть оновлені','This will delete an inbox notification by slug'=>'Це призведе до видалення вхідного сповіщення за слаґом','The world’s favorite buy now, pay later options and many more are right at your fingertips with WooPayments — all from one dashboard, without needing multiple extensions and logins.'=>'Завдяки WooPayments тепер у вашому розпорядженні популярна в усьому світі опція розстрочки "купи зараз, плати потім" (BNPL) і безліч інших функцій - усі керуються з єдиної панелі, без необхідності встановлювати численні розширення та запам\'ятовувати безліч паролів.','Our services'=>'Наші послуги','Net Sales'=>'Чистий обсяг продажів','Enhance your store with extensions'=>'Розширте свій магазин за допомогою розширень','Table cell format.'=>'Формат комірки таблиці.','Create anything'=>'Створюйте будь-що','Navigating life\'s intricate fabric, choices unfold paths to the