y another process.'=>'Невизначена дія %s: не вдалося визначити дату цієї дії. Можливо, вона була видалена іншим процесом.','Invalid slug.'=>'Невірний слаґ.','Count partial downloads'=>'Підрахунок часткових завантажень','During checkout'=>'Під час оформлення замовлення','Enable log-in during checkout'=>'Активувати вхід у систему під час оформлення замовлення','Enable guest checkout (recommended)'=>'Увімкнути оформлення замовлення для гостей (рекомендовано)','On "My account" page'=>'На сторінці "Мій обліковий запис"','Count downloads even if only part of a file is fetched.'=>'Підрахунок кількості завантажень, навіть якщо завантажено тільки частину файлу.','Send password setup link (recommended)'=>'Надіслати посилання для встановлення пароля (рекомендовано)','Account creation options'=>'Параметри створення облікового запису','Customers can create an account before placing their order.'=>'Покупці можуть створити обліковий запис перед оформленням замовлення.','Delete shipping'=>'Видалити доставку','Edit shipping'=>'Редагувати доставку','Delete fee'=>'Видалити збір','Edit fee'=>'Редагувати збір','Enter a barcode or any other identifier unique to this product. It can help you list this product on other channels or marketplaces.'=>'Введіть штрихкод або будь-який інший унікальний ідентифікатор товару. Це допоможе вам виставляти товар на продаж в інших мережах або на маркетплейсах.','Please enter only numbers and hyphens (-).'=>'Будь ласка, вводьте лише цифри та дефіси (-).','This coupon is password protected. WooCommerce does not support password protection for coupons. You can temporarily hide a coupon by making it private. Alternatively, usage limits and restrictions can be configured below.'=>'Цей купон захищено паролем. WooCommerce не підтримує захист паролем для купонів. Ви можете тимчасово приховати купон, зробивши його приватним. Або налаштуйте обмеження та ліміти використання нижче.','Invalid or duplicated GTIN, UPC, EAN or ISBN.'=>'Неправильний або дубльований GTIN,