egacy REST API</a>.' . "\0" . 'Ці веб-хуки мають символ ⚠️ перед своїм ім\'ям у списку нижче. Будь ласка, або відредагуйте веб-хуки, щоб використовувати інший формат доставки, або встановіть та активуйте <a href="%s" target="_blank">розширення WooCommerce Legacy REST API</a>.' . "\0" . 'Ці веб-хуки мають символ ⚠️ перед своїм ім\'ям у списку нижче. Будь ласка, або відредагуйте веб-хуки, щоб використовувати інший формат доставки, або встановіть та активуйте <a href="%s" target="_blank">розширення WooCommerce Legacy REST API</a>.','There\'s %d webhook that is configured to be delivered using the Legacy REST API, which has been removed from WooCommerce. This webhook will fail to be sent.'=>'Існує %d веб-хук, який налаштовано на доставку за допомогою Legacy REST API, який було видалено з WooCommerce. Цей веб-хук не буде надіслано.' . "\0" . 'Існує %d веб-хуків, який налаштовано на доставку за допомогою Legacy REST API, який було видалено з WooCommerce. Ці веб-хуки не буде надіслано.' . "\0" . 'Існує %d веб-хуків, який налаштовано на доставку за допомогою Legacy REST API, який було видалено з WooCommerce. Ці веб-хуки не буде надіслано.','Incompatible webhooks warning'=>'Попередження про несумісність вебхуків','This webhook is configured to be delivered using the Legacy REST API, but the Legacy REST API plugin is not installed on this site.'=>'Цей вебхук налаштований на доставку за допомогою старого API REST, але плагін старого API REST не встановлений на цьому сайті.','block descriptionShows the subtotal, fees, discounts, shipping and taxes.'=>'Показує проміжний підсумок, збори, знижки, доставку та податки.','block titleTotals'=>'Загалом','block titleComing Soon'=>'Незабаром','Store coming soon'=>'Магазин скоро відкриється','⚠ <b><a target="_blank" href="%s">The Legacy REST API</a> is active on this site.</b> Please be aware that the WooCommerce Legacy REST API is <b>not</b> compatible with HPOS.'=>'⚠ <b><a target="_blank" href="%s">Спадковий REST API</a> діє на цьому