ньте помилки вище.' . "\0" . 'Очищення завершено для %d замовлень. Перегляньте помилки вище.','Failed to clean up all orders in a batch. Aborting.'=>'Не вдалося очистити всі замовлення у партії. Переривання операції.','Template namePage: Coming soon'=>'Сторінка: Скоро буде доступна','Your store might be at risk as you are running old versions of WooCommerce plugins.'=>'Ваш магазин може бути у небезпеці, оскільки ви використовуєте старі версії плагінів WooCommerce.','
