		','Order attribution information.'=>'Інформація про призначення замовлення.','Something big is brewing! Our store is in the works and will be launching soon!'=>'Щось велике готується! Наш магазин вже у процесі створення і незабаром буде запущений!','Name of credit cardCartes Bancaires'=>'Cartes Bancaires','Great things are on the horizon'=>'Великі справи на горизонті',' <a href="%1$s" class="woocommerce-connect-your-store">Connect your store</a> to woocommerce.com to update.'=>' <a href="%1$s" class="woocommerce-connect-your-store">Підключіть свій магазин</a> до woocommerce.com для оновлення.','There was an error processing your order. Please check for any charges in your payment method and review your <a href="%s">order history</a> before placing the order again.'=>'Під час обробки вашого замовлення виникла помилка. Будь ласка, перевірте наявність будь-яких оплат на вашому способі оплати та перегляньте вашу <a href="%s">історію замовлень</a> перед повторним оформленням замовлення.','block keywordfields'=>'поля','block keywordselect'=>'вибрати','block descriptionA select field for use in the product editor.'=>'Поле вибору для використання в редакторі товару.','block titleProduct select field'=>'Поле вибору товару','block keywordcustom'=>'користувацький','block titleProduct custom fields toggle control'=>'Керування перемикачем користувацьких полів товару','block descriptionThe product custom fields toggle.'=>'Перемикач користувацьких полів товару.','block titleProduct custom fields control'=>'Керування користувацькими полями товару','block descriptionThe product custom fields.'=>'Користувацькі поля товару.','Live'=>'Наживо','Site visibility'=>'Видимість сайту','Approving will share credentials with %s. Do not proceed if this looks suspicious in any way.'=>'Затвердження дозволить обмінювати облікові дані з %s. Не продовжуйте, якщо це виглядає підозріло яким-небудь чином.','Plugin installed by %1$s on %2$s.'=>'Плагін встановлено %1$s на %2$s.','Plugin installed by %1$s on %2$s. <a target="_blank" href="%3$s">More information</a>'=>'Плагін встановлено %1$s на %2$s. <a target="_blank" href="%3$s">Додаткова інформація</a>','Enter an optional note attached to the order confirmation message sent to the shopper.'=>'Введіть необов\'язкову нотатку, приєднану до повідомлення підтвердження замовлення, відправленого покупцю.','Custom fields'=>'Власні поля','Show custom fields'=>'Показати спеціальні поля','Use global attributes to allow shoppers to filter and search for this product. Use custom attributes to provide detailed product information.'=>'Використовуйте глобальні атрибути, щоб дозволити покупцям фільтрувати та шукати цей товар. Використовуйте спеціальні атрибути, щоб надати докладну інформацію про товар.','Custom fields can be used in a variety of ways, such as sharing more detailed product information, showing more input fields, or for internal inventory organization. %1$sRead more about custom fields%2$s'=>'Спеціальні поля можна використовувати різними способами, наприклад, надавати більш детальну інформацію про товар, показувати більше полів для введення або для внутрішної організації запасів. %1$sДізнайтеся більше про спеціальні поля%2$s.','Post-purchase note'=>'Нотатка після покупки','Per your %1$sstore settings%2$s, taxes are not enabled.'=>'Згідно з вашими %1$sналаштуваннями магазину%2$s, податки не ввімкнені.','Unable to create backup post for order %d.'=>'Не вдалося створити резервний запис для замовлення %d.','%s is not a valid order property.'=>'%s - це недійсний параметр замовлення.' . "\0" . '%s - це недійсні параметри замовлення.' . "\0" . '%s - це недійсні параметри замовлення.','%s is an internal meta key. Use --props to set it.'=>'%s - це внутрішній мета-ключ. Використовуйте --props для його встановлення.' . "\0" . '%s - це внутрішні мета-ключі. Використовуйте --props для їх встановлення.' . "\0" . '%s - це внутрішні мета-ключі. Використовуйте --props для їх встановлення.','The backup datastore does not support updating orders.'=>'Збережені дані не підтримують оновлення замовлень.','Please review the errors above.'=>'Будь ласка, перегляньте помилки вище.','New custom field name'=>'Назва нового власного поля','WooCommerce Blocks development mode requires files to be built. From the root directory, run %1$s to ensure your node version is aligned, run %2$s to install dependencies, %3$s to build the files or %4$s to build the files and watch for changes.'=>'Режим розробки блоків WooCommerce вимагає побудови файлів. З кореневого каталогу виконайте %1$s, щоб переконатися, що версія вашого вузла відповідає, виконайте %2$s для встановлення залежностей, %3$s для побудови файлів або %4$s для побудови файлів і спостереження за змінами.','Overriding existing data with an already registered key is not allowed'=>'Перевизначення існуючих даних вже зареєстрованим ключем не допускається','The metaboxhidden_product meta from the user metas.'=>'Мета metaboxhidden_product від метаданих користувача.','Set up your payment methods and accept credit and debit cards, cash, bank transfers and money from your Mercado Pago account. Offer safe and secure payments with Latin America’s leading processor.'=>'Налаштуйте свої методи оплати та приймайте кредитні та дебетові картки, готівку, банківські перекази та гроші з вашого облікового запису Mercado Pago. Пропонуйте безпечні та надійні платежі з провідним процесором Латинської Америки.','Key for the data being registered must be a string'=>'Ключ для даних, що реєструються, повинен бути рядком','Mercado Pago'=>'Mercado Pago','Collect sales tax'=>'Збирайте податок з продажів','Add your products'=>'Додайте свої товари','It\'s time to celebrate – you\'re ready to launch your store! Woo! Hit the button to preview your store and make it public.'=>'Час святкувати - ви готові запустити свій магазин! Уху! Натисніть кнопку, щоб попередньо переглянути свій магазин та зробити його публічним.','Grow your business'=>'Розвивайте свій бізнес','Launch your store'=>'Запустіть свій магазин','Current price is: %s.'=>'Поточна ціна: %s.','Original price was: %s.'=>'Оригінальна ціна: %s.','Get your products shipped'=>'Отримайте доставку своїх товарів','Checkout can be customized <a href="%s">in the Editor</a> with your active theme.'=>'Оформлення замовлення можна налаштувати <a href="%s">в редакторі</a> з активною темою.','⚠️ WooCommerce attempted to install <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but the installation failed (see error details in <a href="%4$s">the WooCommerce logs</a>). Please install and activate the plugin manually. <a href="%5$s">More information</a>'=>'⚠️ WooCommerce намагався встановити <a href="%1$s">плагін WooCommerce Legacy REST API</a>, оскільки на цьому сайті увімкнено <a href="%2$s">Legacy REST API</a> або є <a href="%3$s">старі вебхуки</a>, але встановлення не вдалося (див. деталі про помилку в <a href="%4$s">журналах WooCommerce</a>). Будь ласка, встановіть та активуйте плагін вручну. <a href="%5$s">Додаткова інформація</a>','ℹ️ WooCommerce installed and activated <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>. <a href="%4$s">More information</a>'=>'ℹ️ WooCommerce встановив і активував <a href="%1$s">WooCommerce Legacy REST API</a>, оскільки на цьому сайті увімкнено <a href="%2$s">старе REST API</a> або є <a href="%3$s">старі вебхуки</a>. <a href="%4$s">Додаткова інформація</a>','WooCommerce installed the Legacy REST API plugin but failed to activate it, see context for more details.'=>'WooCommerce встановив плагін WooCommerce Legacy REST API, але не вдалося активувати його, див. контекст для отримання детальнішої інформації.','⚠️ WooCommerce installed <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but it failed to activate it (see error details in <a href="%4$s">the WooCommerce logs</a>). Please go to <a href="%5$s">the plugins page</a> and activate it manually. <a href="%6$s">More information</a>'=>'⚠️ WooCommerce встановив <a href="%1$s">плагін Legacy REST API</a>, оскільки на цьому сайті ввімкнено <a href="%2$s">спадковий REST API</a> або визначено <a href="%3$s">спадкові вебхуки</a>, але не вдалося його активувати (див. деталі помилки в <a href="%4$s">журналах WooCommerce</a>). Будь ласка, перейдіть на <a href="%5$s">сторінку плагінів</a> та активуйте його вручну. <a href="%6$s">Додаткова інформація</a>','To allow logging, make %s writable.'=>'Для ведення журналу, зробіть %s доступним для запису.','Please enter a valid email to use coupon code "%s".'=>'Будь ласка, введіть дійсну електронну адресу, щоб скористатися кодом купона "%s".','Please enter a valid email at checkout to use coupon code "%s".'=>'Будь ласка, введіть дійсну електронну адресу при оформленні замовлення, щоб скористатися кодом купона "%s".','Explore a new enhanced delivery method that allows you to easily offer one or more pickup locations to your customers in the <a href="%s">Local pickup settings page</a>.'=>'Досліджуйте новий вдосконалений метод доставки, який дозволяє легко пропонувати одне або кілька місць самовивозу вашим клієнтам на сторінці <a href="%s">налаштувань власного самовивозу</a>.','Local pickup: Set up pickup locations in the <a href="%s">Local pickup settings page</a>.'=>'Розміщення для самовивозу: Налаштуйте розміщення для самовивозу на сторінці <a href="%s">налаштувань розміщення для самовивозу</a>.','Gathering usage data allows us to tailor your store setup experience, offer more relevant content, and help make WooCommerce better for everyone.'=>'Збір даних про використання дозволяє нам налаштувати ваш досвід налаштування магазину, пропонувати більш відповідний вміст і допомагати зробити WooCommerce краще для всіх.','Please <a href="%1$s">Install the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions. Alternatively, you can <a href="%2$s">download</a> and install it manually.'=>'Будь ласка, <a href="%1$s">встановіть WooCommerce.com Update Manager</a>, щоб продовжувати отримувати оновлення та підтримку, які включені в ваші підписки WooCommerce.com. Крім того, ви можете <a href="%2$s">завантажити</a> та встановити його вручну.','Please <a href="%1$s">activate the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions.'=>'Будь ласка, <a href="%1$s">активуйте WooCommerce.com Update Manager</a>, щоб продовжувати отримувати оновлення та підтримку, які включені у ваші підписки на WooCommerce.com.',' <a href="%1$s">Install WooCommerce.com Update Manager</a> to update.'=>' <a href="%1$s">Встановіть WooCommerce.com Update Manager</a> для оновлення.',' Activate WooCommerce.com Update Manager to update.'=>' Активуйте WooCommerce.com Update Manager для оновлення.','block keywordrich-text'=>'текст із форматуванням','block descriptionA text-area field for use in the product editor.'=>'Поле для введення тексту для використання в редакторі товару.','block titleProduct textarea block'=>'Блок текстової області товару','block keywordtextarea'=>'текстова область','block descriptionThe product subsection description.'=>'Опис підрозділу товару.','block keywordsubsection'=>'підрозділ','block titleProduct subsection description'=>'Опис підрозділу товару','Immediately'=>'Негайно','Internal server error'=>'Внутрішня помилка сервера','Invalid %s provided.'=>'Надано недійсний %s.','Sorry, you cannot create resources.'=>'Ви не можете створювати ресурси.','Sorry, you cannot delete resources.'=>'Ви не можете видаляти ресурси.','Sorry, you cannot view resources.'=>'Ви не можете переглядати ресурси.','True to force the creation of a new receipt even if one already exists and has not expired yet.'=>'Вірно створювати нову квитанцію навіть якщо вже існує і ще не закінчилася.','Receipt'=>'Квитанція','Order not found'=>'Замовлення не знайдено','Discount (%s)'=>'Знижка (%s)','Receipt not found'=>'Квитанцію не знайдено','Account Type'=>'Тип облікового запису','AID'=>'AID','Amount Paid'=>'Сума сплачена','Number of days to be added to the current date to get the expiration date.'=>'Кількість днів, які потрібно додати до поточної дати, щоб отримати термін дії.','Payment method'=>'Спосіб оплати','Stop converting'=>'Зупинити конвертацію','Date Paid'=>'Дата оплати','Unique identifier of the order.'=>'Унікальний ідентифікатор замовлення.','Background process for coupon meta conversion already started, nothing done.'=>'Процес фонового перетворення метаданих купона вже розпочато, нічого не виконано.','Background process for coupon meta conversion not started, nothing done.'=>'Процес фонового перетворення метаданих купона не розпочато, нічого не виконано.','Background process for coupon meta conversion started'=>'Розпочато фоновий процес конвертації метаданих купона','Background process for coupon meta conversion stopped'=>'Процес фонового перетворення метаданих купона припинено','Convert order coupon data to the simplified format'=>'Перетворити дані купона замовлення до спрощеного формату','Public url of the receipt.'=>'Публічна URL квитанції.','Receipt from %s'=>'Квитанція від %s','Stop converting order coupon data to the simplified format'=>'Припинити конвертацію даних купонів замовлення в спрощений формат','This will convert <code>coupon_data</code> order item meta entries to simplified <code>coupon_info</code> entries. The conversion will happen overtime in the background (via Action Scheduler). There are currently %d entries that can be converted.'=>'Це перетворить записи метаданих пунктів замовлення <code>coupon_data</code> на спрощені записи <code>coupon_info</code>. Конвертація відбудеться поступово в фоновому режимі (за допомогою планувальника дій). Наразі існує %d записів, які можна конвертувати.','This will convert <code>coupon_data</code> order item meta entries to simplified <code>coupon_info</code> entries. The conversion will happen overtime in the background (via Action Scheduler). There are currently no entries to convert.'=>'Це перетворить записи метаданих пунктів замовлення <code>coupon_data</code> на спрощені записи <code>coupon_info</code>. Конвертація відбудеться поступово на фоні (за допомогою планувальника дій). Наразі немає записів для конвертації.','This will stop the background process that converts <code>coupon_data</code> order item meta entries to simplified <code>coupon_info</code> entries. There are currently %d entries that can be converted.'=>'Це призведе до зупинки фонового процесу, який перетворює записи метаданих елементів замовлення <code>coupon_data</code> на спрощені записи <code>coupon_info</code>. Зараз можна конвертувати %d записів.','Summary: Order #%d'=>'Підсумок: Замовлення №%d','Expiration date of the receipt, formatted as yyyy-mm-dd.'=>'Дата закінчення терміну дії квитанції, у форматі dd-mm-yyyy.','Expiration date formatted as yyyy-mm-dd.'=>'Дата закінчення терміну дії у форматі рррр-мм-дд.','Application Name'=>'Назва додатка','Previous image'=>'Попереднє зображення','Next image'=>'Наступне зображення','Clear data'=>'Очистити дані','\'%s\' is not a valid datastore.'=>'\'%s\' - це недійсне сховище даних.','An error occurred while backfilling order %1$d from %2$s to %3$s: %4$s'=>'Під час заповнення замовлення %1$d з %2$s до %3$s виникла помилка: %4$s','Clearing data...'=>'Очищення даних...','No orders in need of cleanup'=>'Немає замовлень, які потребують очищення','%d is not an order or has an invalid order type.'=>'%d не є замовленням або має недійсний тип замовлення.','Clean up order data from legacy tables'=>'Очистіть дані замовлення із застарілих таблиць','Directory size: %s'=>'Розмір директорії: %s','Only available when HPOS is authoritative and compatibility mode is disabled.'=>'Доступно лише тоді, коли HPOS є авторитетним і режим сумісності вимкнено.','Order %1$d backfilled from %2$s to %3$s.'=>'Замовлення %1$d заповнено з %2$s до %3$s.','Order %1$d legacy data could not be cleaned up during batch process. Error: %2$s'=>'Застарілі дані замовлення %1$d не вдалося очистити під час пакетної обробки. Помилка: %2$s','Order legacy cleanup failed for an entire batch of orders. Aborting cleanup.'=>'Очищення застарілих замовлень не вдалося для цілої групи замовлень. Припиняю очищення.','Order legacy data cleanup has been canceled.'=>'Замовлення на очищення застарілих даних скасовано.','Order legacy data cleanup process has been started.'=>'Розпочато процес очищення застарілих даних замовлень.','This tool will clear the data from legacy order tables in WooCommerce.'=>'Цей інструмент очистить дані зі старих таблиць замовлень у WooCommerce.','Start converting order coupon data to the simplified format'=>'Почніть конвертувати дані купона замовлення в спрощений формат','The %s hook has a filter set, so some log files may have different retention settings.'=>'Хук %s має набір фільтрів, тому деякі файли журналів можуть мати інші налаштування збереження.','Please use different source (--from) and destination (--to) datastores.'=>'Будь ласка, використовуйте різні джерела даних (--from) та призначення (--to).','Please provide a valid order ID.'=>'Будь ласка, вкажіть дійсний ID замовлення.','Start converting'=>'Почати конвертацію','Taounate'=>'Таунате','Tata'=>'Тата','Taza'=>'Таза','Tiznit'=>'Тизніт','Tan-Tan'=>'Тан-Тан','Logging'=>'Ведення журналу','Discount type.'=>'Тип знижки.','Logging.'=>'Ведення журналу.','Handler'=>'Обробник','How log entries are being stored.'=>'Як зберігаються записи журналу.','How many days log entries will be kept before being auto-deleted.'=>'Скільки днів будуть зберігатися записи журналу перед автоматичним видаленням.','Sidi Youssef Ben Ali'=>'Сіді Юсеф Бен Алі'