ations.'=>'Відображати додаткові поля для оформлення замовлення з розділів "контакти" та "замовлення".','Medium'=>'Середній','Tip: By suggesting complementary products in the cart using cross-sells, you can significantly increase the average order value.'=>'Порада: Пропонуючи додаткові товари в кошику за допомогою перехресних продажів, ви можете значно збільшити середню вартість замовлення.','Re-schedule expired transient files cleanup'=>'Відкласти очищення прострочених тимчасових файлів','Re-schedule'=>'Перепланувати','Remove the currently scheduled action to delete expired transient files, then schedule it again for running immediately. Subsequent actions will run once every 24h.'=>'Видаліть поточно заплановану дію щодо видалення прострочених тимчасових файлів, а потім відкладіть її для запуску негайно. Подальші дії будуть запускатися один раз на кожні 24 години.','Remove the currently scheduled action to delete expired transient files. Expired files won\'t be automatically deleted until the \'Schedule expired transient files cleanup\' tool is run again.'=>'Видаліть поточно заплановану дію щодо видалення прострочених тимчасових файлів. Прострочені файли не будуть автоматично видалені до тих пір, поки знову не буде запущено інструмент "Відкласти очищення прострочених тимчасових файлів".','Schedule expired transient files cleanup'=>'Відкласти очищення тимчасових файлів, які вийшли з ладу','Schedule the action to delete expired transient files for running immediately. Subsequent actions will run once every 24h.'=>'Відкласти дію видалення застарілих тимчасових файлів для запуску негайно. Подальші дії будуть виконуватися раз на 24 години.','Un-schedule expired transient files cleanup'=>'Відкласти очищення застарілих тимчасових файлів','Un-schedule'=>'Скасувати розклад','By suggesting complementary products in the cart using cross-sells, you can significantly increase the average order value. %1$sLearn more about linked products%2$s'=>'Пропонуючи супутні товари в кошику за допомогою перехресних продажів, ви можете істотно збільшити середній чек. %1$sДетальніше про супутні товари%2$s','Linked products'=>'Супутні товари','Unable to start synchronization. The link you followed may have expired.'=>'Не вдалося запустити синхронізацію. Можливо, термін дії посилання, за яким ви перейшли, закінчився.','You do not have permission to manage logging settings.'=>'Ви не маєте дозволу на керування налаштуваннями ведення журналу.','Database settings'=>'Налаштування бази даних','Log entries are stored in this database table: %s'=>'Записи журналу зберігаються в цій таблиці бази даних: %s','File system settings'=>'Налаштування файлової системи','Include downloads'=>'Включити завантаження','⚠️ This directory does not appear to be writable.'=>'⚠️ Директорія недоступна для запису.','Tip: Upsells are products that are extra profitable or better quality or more expensive. Experiment with combinations to boost sales.'=>'Порада: Пропозиція товарів - це товари, які є більш прибутковими, якіснішими або дорожчими. Пробуйте різні комбінації, щоб збільшити продажі.','Log files are stored in this directory: %s'=>'Файли журналу зберігаються в цій директорії: %s','Customer Email'=>'Email покупця','Upsells are typically products that are extra profitable or better quality or more expensive. Experiment with combinations to boost sales. %1$sLearn more about linked products%2$s'=>'Пропозиція товарів - це, як правило, найбільш прибуткові, якісні або дорогі товари. Пробуйте різні комбінації, щоб збільшити продажі. %1$sДетальніше про супутні товари%2$s','Retention period'=>'Термін зберігання','Level threshold'=>'Поріг рівня','This determines where log entries are saved.'=>'Цей параметр визначає, де зберігаються записи журналу.','This sets how many days log entries will be kept before being auto-deleted.'=>'Цей параметр визначає, скільки днів будуть зберігатися записи журналу перед автоматичним видаленням.','Log storage'=>'Сховище записів журналу','This setting cannot be changed here because it is defined in the %s constant.'=>'Цей параметр неможливо змінити тут, оскільки він визначений у константі %s.','HPOS enabled?: %s'=>'HPOS увімкнено?: %s','Unsynced orders: %d'=>'Несинхронізовані замовлення: %d','Compatibility mode enabled?: %s'=>'Режим сумісності увімкнено?: %s','Orders subject to cleanup: %d'=>'Замовлення, що підлягають очищенню: %d','Database (not recommended on live sites)'=>'База даних (не рекомендується для діючих сайтів)','File system (default)'=>'Файлова система (за замовчуванням)','Logger'=>'Реєстратор','No differences found.'=>'Відмінностей не знайдено.','An error occurred while computing a diff for order %1$d: %2$s'=>'Сталася помилка при обчисленні різниці для замовлення %1$d: %2$s','A link to a product sold on a different website, e.g. brand collab.'=>'Посилання на товар, що продається на іншому веб-сайті, наприклад, колаборація брендів.','This setting cannot be changed here because it is defined in the %1$s constant, probably in your %2$s file.'=>'Цей параметр не можна змінити тут, оскільки він визначений у константі %1$s, ймовірно, у вашому файлі %2$s.','This setting cannot be changed here because it is being set by a filter on the %s hook.'=>'Цей параметр неможливо змінити тут, оскільки він визначається фільтром хука дії %s.','Note that if this setting is changed, any log entries that have already been recorded will remain stored in their current location, but will not migrate.'=>'Зверніть увагу, що якщо цей параметр змінити, всі записи журналу, які вже були записані, залишаться у своєму поточному розташуванні, але не будуть перенесені.','Logs settings'=>'Налаштування журналів','This sets the minimum severity level of logs that will be stored. Lower severity levels will be ignored. "None" means all logs will be stored.'=>'Цей параметр визначає мінімальний рівень серйозності записів журналу, які будуть зберігатися. Записи журналів нижчого рівня серйозності будуть ігноруватися. "Немає" означає, що зберігатися будуть усі журнали.','Logging is disabled. It can be enabled in <a href="%s">Logs Settings</a>.'=>'Ведення журналу вимкнено. Його можна увімкнути в <a href="%s">налаштуваннях журналу</a>.','%1$s log file from source %2$s was deleted.'=>'%1$s файл журналу із джерела %2$s було видалено.' . "\0" . '%1$s файли журналу із джерела %2$s було видалено.' . "\0" . '%1$s файлів журналу із джерела %2$s було видалено.','A set of products that go well together, e.g. camera kit.'=>'Набір товарів, які підходять один до одного, наприклад аксесуари до фотоапарата.','A single physical or virtual product, e.g. a t-shirt or an eBook.'=>'Окремий фізичний або віртуальний товар, наприклад футболка або електронна книга.','Differences found for order %d:'=>'У замовленні %d знайдено відмінності:','Affiliate product'=>'Партнерський товар','Airwallex Payments'=>'Платежі Airwallex','Boost international sales and save on FX fees. Accept 60+ local payment methods including Apple Pay and Google Pay.'=>'Збільшуйте міжнародні продажі та заощаджуйте на валютних комісіях. Приймайте платежі за допомогою більш ніж 60 способів оплати, включаючи Apple Pay та Google Pay.','Collect and showcase verified reviews that consumers trust.'=>'Збирайте та демонструйте перевірені відгуки, яким довіряють споживачі.','Integrate your WooCommerce store with 5000+ cloud apps and services today. Trusted by 11,000+ users.'=>'Інтегруйте свій магазин WooCommerce з 5000+ хмарними застосунками та сервісами вже сьогодні. Нам довіряють понад 11 000 користувачів.','Turn your product images into stunning videos that engage and convert audiences - no video experience required.'=>'Перетворіть зображення ваших товарів на приголомшливі відеоролики, які залучають та конвертують аудиторію. Для цього не потрібно мати досвід роботи з відео.','Harness data from WooCommerce to grow your business. Manage leads, customers, and segments, through automation, quotes, invoicing, billing, and email marketing. Power up your store with CRM.'=>'Скористайтеся даними WooCommerce для розвитку свого бізнесу. Керуйте потенційними та реальними клієнтами, сегментами продажів за допомогою автоматизації, розцінок, розсилки квитанцій, виставлення рахунків і маркетингу електронною поштою. Підвищуйте ефективність свого магазину за допомогою CRM.','Delight customers and boost organic sales with a special WooCommerce birthday email (and coupon!) on their special day.'=>'Порадуйте клієнтів і стимулюйте органічні продажі за допомогою спеціальної розсилки WooCommerce до дня народження (з купоном!).','Give away a free item to any customer with the coupon code.'=>'Подаруйте безкоштовний товар будь-якому клієнту з кодом купона.','Create "store credit" coupons for customers which are redeemable at checkout.'=>'Створіть власні купони "кредит магазину" для клієнтів, які можна використати при оформленні замовлення.','Create a unique URL that applies a discount and optionally adds one or more products to the customer\'s cart.'=>'Створіть унікальний URL, який надає знижку та необов\'язково додає один або кілька товарів у кошик покупця.','Generate dynamic personalized coupons for your customers that increase purchase rates.'=>'Створюйте власні динамічні персоналізовані купони для своїх клієнтів, які збільшують швидкість покупок.','Powerful, "all in one" solution for gift certificates, store credits, discount coupons and vouchers.'=>'Могутня, "все в одному" рішення для подарункових сертифікатів, кредитів у магазині, знижкових купонів та ваучерів.','Coupons for groups. Provides the option to have coupons that are restricted to group members or roles. Works with the free Groups plugin.'=>'Купони для груп. Надає можливість мати купони, які обмежені для учасників груп або ролей. Працює з безкоштовним плагіном Groups.','Sync your website\'s data like contacts, products, and orders over Salesforce CRM with Salesforce Integration for WooCommerce.'=>'Синхронізуйте дані вашого веб-сайту, такі як контакти, товари та замовлення, з CRM Salesforce за допо