>'Не вдалося отримати макети товарів.','Confirm email and view order'=>'Підтвердіть email та перегляньте замовлення','Alternatively, confirm the email address linked to the order below.'=>'В якості альтернативи, підтвердіть адресу електронної пошти, вказану в наведеному нижче замовленні.','Have an account with us? %1$sLog in here%2$s to view your order.'=>'Ви маєте обліковий запис у нас? %1$sУвійдіть сюди%2$s, щоб переглянути своє замовлення.','Please check your email for the order confirmation.'=>'Будь ласка, перевірте свою електронну пошту для підтвердження замовлення.','Try again'=>'Спробувати знову','Your order cannot be processed as the originating bank/merchant has declined your transaction. Please attempt your purchase again.'=>'Ваше замовлення не може бути оброблене, оскільки банк/продавець відхилив вашу транзакцію. Будь ласка, спробуйте здійснити покупку ще раз.','Thank you. Your order has been fulfilled.'=>'Дякуємо. Ваше замовлення виконано.','Your order has been cancelled.'=>'Ваше замовлення було скасовано.','Your order was refunded %s.'=>'Ваше замовлення було повернуто %s.','Default values for generated variations.'=>'Початкові значення для створених варіацій.','Attribute term.'=>'Значення атрибута.','Placeholder image used to represent products being showcased under the social media icons. 4 out of 4.'=>'Зображення-заповнювач, що використовується для представлення товарів, які демонструються під іконками соціальних мереж. 4 з 4.','Placeholder image used to represent products being showcased under the social media icons. 3 out of 4.'=>'Зображення-заповнювач, що використовується для представлення товарів, які демонструються під іконками соціальних мереж. 3 з 4.','Placeholder image used to represent products being showcased under the social media icons. 2 out of 4.'=>'Зображення-заповнювач, що використовується для представлення товарів, які демонструються під іконками соціальних мереж. 2 з 4.','Placeholder image used to represent products being showcased u