лючення:','If you don\'t have an application password (not your account password), generate a password from %s'=>'Якщо у вас немає пароля для застосунка (це не пароль для вашого облікового запису), створіть його в %s','Customers can still save the file to their device, but by default file will be opened instead of being downloaded (does not work with redirects).'=>'Покупці все ще можуть зберегти файл на своєму пристрої, але за замовчуванням файл буде відкрито, а не завантажено (не працює з переадресацією).','Open downloadable files in the browser, instead of saving them to the device.'=>'Відкривайте завантажувані файли в браузері, замість того щоб зберігати їх на пристрої.','Summarize this product in 1-2 short sentences. We’ll show it at the top of the page.'=>'Опишіть цей товар за допомогою 1–2 коротких речень. Цей опис відображатиметься у верхній частині сторінки.','Your store is not connected to WooCommerce.com. Run `wp wc com connect` command.'=>'Ваш магазин не підключений до WooCommerce.com. Виконайте команду `wp wc com connect`.','Are you sure you want to disconnect your store from WooCommerce.com?'=>'Ви впевнені, що хочете відключити свій магазин від WooCommerce.com?','Describe this product. What makes it unique? What are its most important features?'=>'Опишіть цей товар. Що робить його унікальним? Які його найважливіші особливості?','Product types define available product details and attributes, such as downloadable files and variations. They’re also used for analytics and inventory management.'=>'Типи товару визначають доступні особливості товару та атрибути, наприклад завантажувані файли та варіанти. Вони також використовуються для аналітики та управління запасами.','<b>Variable –</b> a product with variations, each of which may have a different SKU, price, stock option, etc. For example, a t-shirt available in different colors and/or sizes.'=>'<b>Варіативний –</b> товар з варіаціями, кожна з яких може мати свій артикул, ціну, кількість запасу і т. д. Наприклад, футболка, доступна в різних кольорах та/або розмірах.','<b>External or Affiliate –</b> one that you list and describe on your website but is sold elsewhere.'=>'<b>Зовнішній або Партнерський –</b> товар, який ви вказуєте та описуєте на своєму веб-сайті, але він продається в іншому місці.','<b>Grouped –</b> a collection of related products that can be purchased individually and only consist of simple products. For example, a set of six drinking glasses.'=>'<b>Згрупований –</b> колекція пов\'язаних товарів, які можна придбати окремо і які складаються тільки з простих товарів. Наприклад, набір із шести склянок.','<b>Simple –</b> covers the vast majority of any products you may sell. Simple products are shipped and have no options. For example, a book.'=>'<b>Звичайний –</b> підходить для більшості товарів, які можна продавати. Звичайні товари можуть бути доставлені та не мають опцій. Наприклад, книга.','Sofia District'=>'Sofia District','block descriptionDisplay a grid of products from your selected categories.'=>'Відображення сітки товарів з вибраних категорій.','block titleProducts by Category'=>'Товари за категорією','block descriptionDisplay a grid of your all-time best selling products.'=>'Відобразити сітку ваших найпопулярніших товарів.','block descriptionDisplay products from your store in a grid layout.'=>'Відображення списку товарів у вигляді сітки.','block descriptionShow all product categories as a list or dropdown.'=>'Показувати всі категорії товарів у вигляді списку або випадаючого списку.','block titleProduct Categories List'=>'Список категорій товарів','block titleBest Selling Products'=>'Товари, що найбільше продаються','block titleAll Products'=>'Усі товари','City:'=>'Місто:','This info will be displayed on the product page, category pages, social media, and search results.'=>'Ця інформація відображатиметься на сторінці товару, категорій, в соціальних мережах та результатах пошуку.','Product Details'=>'Деталі товару','Postcode / ZIP:'=>'По