issing.'=>'Статус замовлення відсутній.','%s terms'=>'%s значень','1 term'=>'1 значення','%1$s... (%2$s more)'=>'%1$s... (ще %2$s)','Displays search results for your store.'=>'Відображає результати пошуку для вашого магазину.','Displays products filtered by a tag.'=>'Відображає товари, відфільтровані за позначкою.','Could not register pattern "%s" as a block pattern ("Title" field missing)'=>'Не вдалося зареєструвати патерн "%s" як патерн блоку (поле "Заголовок" відсутнє)','Could not register pattern "%1$s" as a block pattern (invalid slug "%2$s")'=>'Не вдалося зареєструвати патерн "%1$s" як шаблон блоку (недійсна частина посилання "%2$s")','Could not register pattern "%s" as a block pattern ("Slug" field missing)'=>'Не вдалося зареєструвати патерн "%s" як патерн блоку (поле "частина посилання" відсутнє)','Discounted rates'=>'Знижки на доставку','Print at home'=>'Роздрукуйте вдома','Buy postage when you need it'=>'Сплачуйте поштові витрати, коли вам це потрібно','Could not persist order to database table "%s".'=>'Не вдалося зберегти замовлення в таблиці бази даних "%s".','Order status changed by bulk edit.'=>'Статус замовлення змінено масовим редагуванням.','The %1$s plugin has been deactivated as the latest improvements are now included with the %2$s plugin.'=>'Плагін %1$s було деактивовано, оскільки його останні покращення тепер включено до плагіна %2$s.','Review shipping options'=>'Переглянути варіанти доставки','Template nameProduct Catalog'=>'Каталог товарів','Template nameSingle Product'=>'Окремий товар','A valid prop name must be specified'=>'Необхідно вказати дійсну назву властивості','A valid event name must be specified.'=>'Необхідно вказати дійсну назву події.','Order date parsed by DateTime::formatM d, Y @ h:i A'=>'d.m.Y @ Н:i','Could not create order in posts table.'=>'Не вдалося створити замовлення в таблиці записів.','Wow your shoppers'=>'Порадуйте своїх покупців','Pick up an order, then just pay, print, package and post.'=>'Прийміть замовлення, по