и форму оформлення замовлень, щоб покупці могли відправляти замовлення.','block descriptionContains the products table and other custom blocks of filled mini-cart.'=>'Містить таблицю товарів та інші довільні блоки заповненого міні-кошика.','block titleMini-Cart Items'=>'Елементи міні-кошика','Email address (optional)'=>'E-mail адреса (необов\'язково)','This means that the table is probably in an inconsistent state. It\'s recommended to run a new regeneration process or to resume the aborted process (Status - Tools - Regenerate the product attributes lookup table/Resume the product attributes lookup table regeneration) before enabling the table usage.'=>'Це означає, що таблиця, ймовірно, у неузгодженому стані. Рекомендується запустити новий процес регенерації або відновити перерваний процес (Статус – Інструменти – Повторно створити таблицю пошуку атрибутів товару/Відновити регенерацію таблиці пошуку атрибутів товару), перш ніж увімкнути використання таблиці.','WARNING: The product attributes lookup table regeneration process was aborted.'=>'УВАГА: Процес регенерації таблиці пошуку атрибутів товару був перерваний.','Resume'=>'Продовжити','Product attributes lookup table regeneration process has been resumed.'=>'Процес регенерації таблиці пошуку атрибутів товару відновлено.','This tool will resume the product attributes lookup table regeneration at the point in which it was aborted (%1$s products were already processed).'=>'Цей інструмент відновить регенерацію таблиці пошуку атрибутів товару в тому місці, в якому вона була перервана (%1$s товарів вже оброблено).','Product attributes lookup table regeneration process has been aborted.'=>'Процес регенерації таблиці пошуку атрибутів товару скасовано.','This tool will abort the regenerate product attributes lookup table regeneration. After this is done the process can be either started over, or resumed to continue where it stopped.'=>'Цей інструмент перерве регенерацію таблиці пошуку атрибутів товару. Після цього процес 