 using the Force Download method. A redirect will be used instead.'=>'%1$s не може використовуватися застосовуючи примусове завантаження. Замість цього буде використовуватися перенаправлення.','%1$s could not be served using the X-Accel-Redirect/X-Sendfile method. A Force Download will be used instead.'=>'%1$s не може використовуватися застосовуючи метод X-Accel-Redirect/X-Sendfile. Замість цього буде використовуватися примусове завантаження.','If the "Force Downloads" or "X-Accel-Redirect/X-Sendfile" download method is selected but does not work, the system will use the "Redirect" method as a last resort. <a href="%1$s">See this guide</a> for more details.'=>'Якщо обрано метод "Примусове завантаження" або "X-Accel-Redirect/X-Sendfile", але він не працює, система буде використовувати метод "Перенаправлення" в крайньому випадку. <a href="%1$s">Ознайомтеся з цим посібником</a>, щоб отримати детальну інформацію.','Allow using redirect mode (insecure) as a last resort'=>'Дозволити використовувати режим перенаправлення (небезпечно) в крайньому випадку','Set your store location and where you\'ll ship to.'=>'Вкажіть місце розташування вашого магазину та місця доставки.','Choose payment providers and enable payment methods at checkout.'=>'Виберіть платіжні системи та способи оплати при оформленні замовлень.','You\'re only one step away from getting paid. Verify your business details to start managing transactions with WooPayments.'=>'Залишився один крок до початку отримання платежів. Перевірте дані своєї компанії, щоб почати керувати транзакціями за допомогою WooPayments.','Start by adding the first product to your store. You can add your products manually, via CSV, or import them from another service.'=>'Для початку додайте в магазин перший товар. Ви можете додавати товари вручну, через CSV або імпортувати їх з іншої служби.','Your store address is required to set the origin country for shipping, currencies, and payment options.'=>'Адреса магазину необхідна, щоб задати країну для налаштування доставки, валюти та способів оплати.','Set your store location and configure tax rate settings.'=>'Вкажіть місце розташування магазину та налаштуйте параметри податкової ставки.','Grow your store'=>'Розвивайте свій магазин','The rate at which tax is applied.'=>'Ставка, за якою застосовується податок.','Get backups'=>'Отримати резервні копії','Store downtime means lost sales. One-click restores get you back online quickly if something goes wrong.'=>'Збої в роботі магазину призводять до втрати прибутку. Відновлення одним натисканням дозволяє швидко повернутися до роботи, якщо щось піде не так.','Protect your WooCommerce Store with Jetpack Backup.'=>'Захистіть свій магазин WooCommerce за допомогою Jetpack Backup.','Notes are unavailable because the "admin-note" data store cannot be loaded.'=>'Нотатки недоступні, оскільки не вдається завантажити сховище даних "admin-note".','Mollie'=>'Mollie','The Payfast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa’s most popular payment gateways. No setup fees or monthly subscription costs. Selecting this extension will configure your store to use South African rands as the selected currency.'=>'Розширення PayFast для WooCommerce дозволяє приймати платежі по кредитній карті та шляхом безготівкових переказів через один з найпопулярніших платіжних шлюзів в Південній Африці. Вам не потрібно буде платити за встановлення або щомісяця оплачувати підписку. При виборі цього розширення в якості валюти в магазині буде використовуватися Південноафриканський ранд.','Number of variation items sold.'=>'Кількість проданих варіацій товару.','Variations Sold'=>'Варіацій продано','Number of product items sold.'=>'Кількість проданих товарів.','Products sold'=>'Товарів продано','Data store:'=>'Сховище даних:','This section shows details of Action Scheduler.'=>'В цьому розділі показані відомості про планувальника дій.','Products by Rating list'=>'Товари за рейтинговим списком'