re'=>'Сукре','Portuguesa'=>'Португеса','Nueva Esparta'=>'Нуева-Еспарта','Monagas'=>'Монагас','Miranda'=>'Міранда','Mérida'=>'Меріда','Lara'=>'Лара','Guárico'=>'Гуаріко','Falcón'=>'Фалькон','Cojedes'=>'Кохедес','Carabobo'=>'Карабобо','Bolívar'=>'Болівар','Barinas'=>'Барінас','Aragua'=>'Арагуа','Apure'=>'Апуре','Anzoátegui'=>'Ансоатегі','Filling in progress (%d)'=>'Заповнення в процесі (%d)','Product attributes lookup table data is regenerating'=>'Дані таблиці пошуку атрибутів товарів регенеруються','Regenerate the product attributes lookup table'=>'Регенерувати таблицю пошуку атрибутів товарів','This tool will regenerate the product attributes lookup table data from existing product(s) data. This process may take a while.'=>'Цей механізм відновить дані таблиці пошуку атрибутів товарів з даних існуючих товарів. Даний процес може зайняти деякий час.','Capital'=>'Копенгаген','Paystack'=>'Paystack','MailPoet'=>'MailPoet','Paystack helps African merchants accept one-time and recurring payments online with a modern, safe, and secure payment gateway.'=>'Paystack допомагає африканським торговцям приймати одноразові та періодичні платежі за допомогою сучасного безпечного платіжного шлюзу.','How easy was it to add a product attribute?'=>'Наскільки легко було додати атрибут товару?','How easy was it to add product category?'=>'Наскільки легко було додати категорію товару?','How easy was it to use search?'=>'Наскільки легко було використовувати пошук?','%s connected successfully'=>'%s успішно підключено','Hi there,'=>'Привіт,','%s (optional)'=>'%s (необов\'язково)','Enable PayU’s exclusive plugin for WooCommerce to start accepting payments in 100+ payment methods available in India including credit cards, debit cards, UPI, & more!'=>'Увімкніть ексклюзивний плагін PayU для WooCommerce, щоб почати приймати платежі більш ніж 100 способами оплати, доступними у вашій країні, включаючи кредитні картки, дебетові картки, UPI та багато іншого!','PayU for WooCommerce'=>'PayU для WooCommerce','Get ready to start selling'=>'Будьте готові почати продавати','Integration "%s" is not registered.'=>'Інтеграція "%s" не зареєстрована.','"%s" is already registered.'=>'"%s" вже зареєстровано.','Integration registry requires an identifier.'=>'Реєстр інтеграції вимагає ідентифікатора.','There was an error with an item in your cart.'=>'Сталася помилка з товаром у вашому кошику.','There are not enough %s in stock. Please reduce the quantities in your cart.'=>'%s недостатньо на складі. Будь ласка, зменшіть кількість у вашому кошику.','There is not enough %s in stock. Please reduce the quantity in your cart.'=>'%s недостатньо на складі. Будь ласка, зменшіть кількість у вашому кошику.','There are too many %s in the cart. Only 1 of each can be purchased. Please reduce the quantities in your cart.'=>'У кошику занадто багато %s. Будь ласка, зменшіть кількість кожного товару в кошику до 1.','There are too many %s in the cart. Only 1 can be purchased. Please reduce the quantity in your cart.'=>'У кошику занадто багато %s. Будь ласка, зменшіть кількість в кошику до 1.','%s cannot be purchased. Please remove them from your cart.'=>'%s неможливо придбати. Будь ласка, видаліть їх із кошика.','%s cannot be purchased. Please remove it from your cart.'=>'%s неможливо придбати. Будь ласка, видаліть його з кошика.','%s are out of stock and cannot be purchased. Please remove them from your cart.'=>'%s немає в наявності і їх не можна придбати. Видаліть їх із кошика.','%s is out of stock and cannot be purchased. Please remove it from your cart.'=>'%s немає в наявності і не може бути придбаний. Видаліть його з кошика.','%1$s and %2$s'=>'%1$s і %2$s','Block name is required.'=>'Необхідно вказати назву блоку.','Start selling'=>'Почати продавати','of'=>'з','Step'=>'Крок','WooCommerce Setup'=>'Налаштування WooCommerce','City name, it doesn\'t support multiple values. Deprecated as of WooCommerce 5.3, \'cities\' should be used instead.'=>'Назва міста не передбачає кілька значень. Це залиши