ackage the shipping rates belong to.'=>'ID пакунку, до якого відносяться тарифи доставки.','List of cart item errors, for example, items in the cart which are out of stock.'=>'Перелік помилок товарів кошика, наприклад, товарів, яких немає в наявності.','The ID of the payment method being used to process the payment.'=>'ID способу оплати, який використовується для обробки платежу.','Total price of shipping.'=>'Загальна вартість доставки.','Result of payment processing, or null if not yet processed.'=>'Результат обробки платежу або нуль, якщо платіж ще не оброблено.','If true, empty terms will not be returned.'=>'Якщо true, порожні умови не повертаються.','Note added to the order by the customer during checkout.'=>'Примітка, додана покупцем до замовлення під час його оформлення.','Order key used to check validity or protect access to certain order data.'=>'Ключ замовлення, який використовується для перевірки точності або захисту доступу до деяких даних замовлення.','Order status. Payment providers will update this value after payment.'=>'Статус замовлення. Платіжний сервіс оновить це значення після платежу.','Quantity left in stock if stock is low, or null if not applicable.'=>'Кількість товару в наявності, якщо запас низький, або нуль, якщо не застосовується.','Customer ID if registered. Will return 0 for guests.'=>'Ідентифікатор покупця, якщо він зареєстрований. Дорівнюватиме 0 для гостей.','Price string formatted as HTML.'=>'Рядок ціни у форматі HTML.','Price data provided using the smallest unit of the currency.'=>'Інформація про ціну в найдрібнішій одиниці валюти.','Product full description in HTML format.'=>'Повний опис товару у форматі HTML.','Product short description in HTML format.'=>'Короткий опис товару у форматі HTML.','&quot;%s&quot; is not available for purchase.'=>'Позиція "%s" недоступна для покупки.','The "%1$s" coupon has been removed from your cart: %2$s'=>'Купон "%1$s" видалено із вашого кошика: %2$s','"%s" has already been applied and cannot be u