ументу.','The active version of WooCommerce does not support template cache clearing.'=>'Активна версія WooCommerce не підтримує очищення кешу шаблону.','Template cache cleared.'=>'Кеш шаблону очищено.','Verify if all base database tables are present.'=>'Перевірити наявність всіх основних таблиць бази даних.','Verify database'=>'Перевірити базу даних','Verify base database tables'=>'Перевірити основні таблиці бази даних','This tool will empty the template cache.'=>'Цей інструмент очистить кеш шаблону.','Clear template cache'=>'Очистити кеш шаблону','Collect and validate EU VAT numbers at checkout'=>'Збирати і перевіряти номери платників ПДВ (ЄС) при оформленні замовлення','If your store is based in the EU, we recommend using the EU VAT Number extension in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'Якщо ваш магазин знаходиться на території ЄС, рекомендуємо крім автоматичних податків використовувати розширення "Номер платника ПДВ (ЄС)". Завдяки йому на сторінці оформлення замовлення з\'являється поле, яке дозволяє збирати і перевіряти номер платника ПДВ в ЄС, якщо такий є у клієнта.','Get real-time order alerts anywhere'=>'Отримуйте сповіщення про замовлення в режимі реального часу, де б ви не знаходилися','First order received'=>'Отримано перше замовлення','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'Отримуйте сповіщення про діяльність магазину, включаючи нові замовлення та відгуки про товари, безпосередньо на свої мобільні пристрої за допомогою додатку Woo.','Maximum number of items to be returned in result set. Defaults to no limit if left blank.'=>'Максимальна кількість позицій, що повертається в наборі результатів. При порожньому полі обмеження відсутні.','Invalid category ID.'=>'Невірний ID категорії.','Verifying database... One or more tables are still missing: '=>'Перевірка 