anage transactions without leaving your WordPress dashboard. Only with <strong>WooPayments</strong>.'=>'Безпечно приймайте кредитні та дебетові карти на своєму сайті. Керуйте транзакціями не покидаючи Майстерню WordPress. Тільки з <strong>WooPayments</strong>.','Try the new way to get paid'=>'Спробуйте новий спосіб отримувати оплату','It appears one or more database tables were missing. Attempting to re-create the missing table(s).'=>'Здається, відсутня одна або кілька таблиць баз даних. Спроба знову створити відсутню таблицю.','Your store is configured to serve digital products using "Redirect only" method. This method is deprecated, <a href="%s">please switch to a different method instead.</a><br><em>If you use a remote server for downloadable files (such as Google Drive, Dropbox, Amazon S3), you may optionally wish to "allow using redirects as a last resort". Enabling that and/or selecting any of the other options will make this notice go away.</em>'=>'Ваш магазин налаштований для обслуговування цифрових товарів способом "Тільки перенаправлення". Цей спосіб застарілий, <a href="%s">будь ласка, перейдіть на інший спосіб.</a><br><em>Якщо ви використовуєте віддалений сервер для завантаження файлів (наприклад, Google Drive, Dropbox, Amazon S3), при бажанні ви можете "дозволити використання перенаправлення в крайньому випадку". Якщо увімкнути цей параметр та/або обрати будь-який інший варіант, це повідомлення зникне.</em>','Get started'=>'Розпочати','Mobile app'=>'Мобільний додаток','Choose theme'=>'Виберіть тему','Send targeted campaigns, recover abandoned carts and much more with Mailchimp.'=>'Mailchimp дозволяє розсилати націлені кампанії, відновлювати залишені кошики покупок та багато іншого.','Set up payments'=>'Налаштування платежів','Securely accept credit and debit cards with one low rate, no surprise fees (custom rates available). Sell online and in store and track sales and inventory in one place.'=>'Безпечно приймайте кредитні та дебетові карти з однією низ