амовлення','Browse'=>'Переглянути','You\'ve hit the 10 orders milestone! Look at you go. Browse some WooCommerce success stories for inspiration.'=>'Ви досягли рівня в 10 замовлень! Подивіться на свій прогрес. Для мотивації перегляньте деякі історії успіху користувачів WooCommerce.','Congratulations on processing %s orders!'=>'Вітаємо з обробкою %s замовлень!','New sales record!'=>'Новий рекорд продажів!','Congratulations on getting your first order! Now is a great time to learn how to manage your orders.'=>'Вітаємо з отриманням першого замовлення! Саме час дізнатися, як керувати своїми замовленнями.','Woohoo, %1$s was your record day for sales! Net sales was %2$s beating the previous record of %3$s set on %4$s.'=>'Ого, %1$s був вашим рекордним днем ​​продажів! Чистий обсяг продажів %2$s побив попередній рекорд %3$s встановлений на %4$s.','Activate usage tracking'=>'Активувати відстеження використання','Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the %1$sSettings%3$s and choose to stop sharing data. %2$sRead more%3$s about what data we collect.'=>'Збір даних про використання дозволяє нам вдосконалити WooCommerce. Інформація про ваш магазин буде використовуватися для оцінки нових функцій, визначення якості оновлень та прийняття рішень про доцільність подальших поліпшень. Ви завжди можете зайти в %1$sНалаштування%3$s і скасувати відправку ваших даних. %2$sДетальніше%3$s про те, які дані ми збираємо.','Another order milestone! Take a look at your Orders Report to review your orders to date.'=>'Черговий етап замовлення. Перегляньте звіт про замовлення, в якому зібрані всі ваші замовлення на сьогоднішній день.','Review'=>'Відгук','Report table data is being deleted.'=>'Дані таблиці звіту видаляються.','Report table data is being rebuilt. Please allow some time for data to fully populate.'=>'Дані таблиці звіту перебудовуються. Будь ласка, почекайте трохи, щоб дані повністю заповнилися.','An import is already in progress. Please allow the previous import to complete before beginning a new one.'=>'Імпорт вже виконується. Дозвольте завершити попередній імпорт, перш ніж починати новий.','The admin note action label prop cannot be empty.'=>'Мітка дії примітки адміністратора не може бути порожньою.','The admin note action name prop cannot be empty.'=>'Назва дії примітки адміністратора не може бути порожньою.','The admin note date prop cannot be empty.'=>'Дата примітки адміністратора не може бути порожньою.','The admin note source prop cannot be empty.'=>'Джерело примітки адміністратора не може бути порожнім.','The admin note status prop (%s) is not one of the supported statuses.'=>'Статус примітки адміністратора (%s) не є одним з підтримуваних статусів.','The admin note status prop cannot be empty.'=>'Статус примітки адміністратора не може бути порожнім.','The admin note content_data prop must be an instance of stdClass.'=>'Примітка адміністратора content_data повинна містити примірник stdClass.','The admin note content prop cannot be empty.'=>'Вміст примітки адміністратора не може бути порожнім.','The admin note title prop cannot be empty.'=>'Заголовок примітки адміністратора не може бути порожнім.','The admin note locale prop cannot be empty.'=>'Мова примітки адміністратора не може бути порожньою.','The admin note type prop (%s) is not one of the supported types.'=>'Тип примітки адміністратора (%s) не є одним з підтримуваних типів.','The admin note type prop cannot be empty.'=>'Тип примітки адміністратора не може бути порожнім.','The admin note name prop cannot be empty.'=>'Назва примітки адміністратора не може бути порожньою.','Default Date Range'=>'Діапазон дат за замовчуванням','Statuses that require extra action on behalf of the store admin.'=>'Статуси, які вимагають додаткових дій від імені адміністратора магазину.','Actionable order statuses'=>'Діючі статуси замовлення','Statuses that should not be included when calculating report totals.'=>'Статуси, які не повинні враховуватися при розрахунку підсумків звіту.','Report sync schedulers should be derived from the Automattic\\WooCommerce\\Internal\\Admin\\Schedulers\\ImportScheduler class.'=>'Планувальники синхронізації звітів повинні бути отримані з класу Automattic\\WooCommerce\\Internal\\Admin\\Schedulers\\ImportScheduler.','The next queue will begin processing in approximately %d seconds.'=>'Обробка наступної черги почнеться приблизно через %d сек.','A new queue has begun processing. <a href="%s">View actions in-progress &raquo;</a>'=>'Почалася обробка нової черги. <a href="%s">Переглянути процес виконання дій &raquo;</a>','Action [%1$s] has an invalid schedule: %2$s'=>'Дія [%1$s] має недійсний розклад: %2$s','%s Support for strings longer than this will be removed in a future version.'=>'%s Підтримка більш довгих рядків буде видалена в наступній версії.','Unknown status found for action.'=>'Знайдено невідомий статус для дії.','Invalid value for select or count parameter. Cannot query actions.'=>'Невірне значення для параметра select або count. Неможливо запросити дії.','Database error.'=>'Помилка бази даних.','Activity log for the action.'=>'Журнал активності для дії.','ActionScheduler_Action::$args too long. To ensure the args column can be indexed, action args should not be more than %d characters when encoded as JSON.'=>'ActionScheduler_Action::$args має занадто велику довжину. Для індексації стовпчика args аргументи дії не повинні містити символів більше %d при кодуванні в форматі JSON.','There was a failure scheduling the next instance of this action: %s'=>'Не вдалося запланувати наступний примірник цієї дії: %s','There was a failure fetching this action: %s'=>'Не вдалося отримати цю дію: %s','action ignored via %s'=>'дія ігнорується через %s','action failed via %1$s: %2$s'=>'дія не вдалася через %1$s: %2$s','action complete via %s'=>'дія завершена через %s','action star