ugins.'=>'У вас немає дозволу на встановлення плагінів.','Learn how to upgrade'=>'Дізнайтеся, як оновити','The sale will start at 00:00:00 of "From" date and end at 23:59:59 of "To" date.'=>'Розпродаж розпочнеться о 00:00:00 від дати "З..." та закінчиться о 23:59:59 від дати "До...".','Order fully refunded.'=>'Замовлення повністю повернено.','Selecting no country / region to sell to prevents from completing the checkout. Continue anyway?'=>'Якщо не обрати жодної країни / регіону куди продавати, то завершити оформлення не вдасться. Все рівно продовжити?','Please enter a valid Eircode.'=>'Введіть дійсний код Eircode.','&larr; Back to "%s" attributes'=>'&larr; Назад до "%s" атрибутів','Product display, sorting, and reports may not be accurate until this finishes. It will take a few minutes and this notice will disappear when complete.'=>'Показ, сортування та звіти товару можуть бути неточними, поки це не закінчиться. Мине кілька хвилин, і це повідомлення зникне, коли буде завершено.','You can manually run queued updates here.'=>'Ви можете вручну запустити оновлення з черги тут.','There was a failure fetching this action'=>'Не вдалося отримати цю дію','Note: WP CRON has been disabled on your install which may prevent this update from completing.'=>'Примітка: WP CRON був відключений у вашому встановленні, це може перешкодити завершенню цього оновлення.','Updating database'=>'Оновлення бази даних','Newest Scheduled Date'=>'Найновіші заплановані дати','Oldest Scheduled Date'=>'Найдавніші заплановані дата','Count'=>'Кількість','Action Status'=>'Статус дії','Action Scheduler'=>'Планувальник дій','Your account was created successfully. Your login details have been sent to your email address.'=>'Ваш обліковий запис успішно створено. Ваші реєстраційні дані надіслано на ваш email.','Your account was created successfully and a password has been sent to your email address.'=>'Ваш обліковий запис успішно створено, і на вашу адресу електронної пошти надіслано пароль.','Stock: %d'=>'