etting belongs to.'=>'ID групи, до якої належить це налаштування.','Order note author.'=>'Автор нотатки до замовлення.','Currency symbol position for this country.'=>'Розташування символа валюти для цієї країні.','Categories totals.'=>'Всього категорій.','Tags totals.'=>'Всього позначок.','Customer type name.'=>'Назва типу клієнта.','Sorry, you are not allowed to change the comment type.'=>'На жаль, вам не дозволено змінювати тип коментаря.','Limit result set to reviews assigned to specific user IDs.'=>'Обмежити набір результатів відгуками із певними ID користувачів.','Thousands separator for displayed prices in this country.'=>'Роздільник тисяч для відображуваних цін у цій країні.','Number of decimal points shown in displayed prices for this country.'=>'Кількість знаків після коми, показаних у відображених цінах для цієї країни.','Decimal separator for displayed prices for this country.'=>'Десятковий роздільник для відображуваних цін для цієї країни.','Limit result set to reviews assigned to specific product IDs.'=>'Обмежити набір результатів відгуками із певними ID товарів.','Details for order #{order_number} on {site_title}'=>'Деталі для замовлення №{order_number} на {site_title}','Your {site_title} order has been received!'=>'Ваше замовлення на сайті {site_title} отримано!','Your {site_title} account has been created!'=>'Ваш обліковий запис на {site_title} створено!','Your {site_title} order is now complete'=>'Ваше замовлення на {site_title} виконано','When handling an %s, should access to downloadable files be revoked and download logs cleared?'=>'Під час обробки %s слід скасувати доступ до завантажених файлів та видалити журнали завантаження?','Export all categories'=>'Експортувати всі категорії','Enter a number to set stock quantity at the variation level. Use a variation\'s \'Manage stock?\' check box above to enable/disable stock management at the variation level.'=>'Введіть число, щоб встановити кількість запасів на рівні варіації. Використовуйте варіант \