tation, щоб заощадити час в поштовому відділенні, надрукувавши ваші етикетки для доставки вдома. Спробуйте ShipStation безкоштовно протягом 30 днів.','Enter attachment ID or URL to an image'=>'Введіть ID вкладення або URL-адресу зображення','This is the attachment ID, or image URL, used for placeholder images in the product catalog. Products with no image will use this.'=>'Це ID вкладення або URL-адреса зображення, яке використовується для заповнювача зображень у каталозі товарів. Вони будуть використовуватись для товарів без зображення.','When handling an %s, should personal data within orders be retained or removed?'=>'При обробці %s слід зберігати чи видаляти особисті дані в замовленнях?','Placeholder image'=>'Зображення-заповнювач','<strong>Your theme (%s) contains outdated copies of some WooCommerce template files.</strong> These files may need updating to ensure they are compatible with the current version of WooCommerce. Suggestions to fix this:'=>'<strong>Ваша тема (%s) містить застарілі копії деяких файлів шаблону WooCommerce.</strong> Ці файли, можливо, знадобиться оновити, щоб переконатися, що вони сумісні з поточною версією WooCommerce. Поради щодо вирішення цієї проблеми:','Meters'=>'Метри','Alto Paraguay'=>'Альто Парагвай','Amambay'=>'Амамбай','Central'=>'Центральний','San Pedro'=>'Сан-Педро','Centimeters'=>'Сантиметри','Item moved up'=>'Товар піднявся','Item moved down'=>'Товар опустився','Kilograms'=>'Кілограми','Pounds'=>'Фунтів','Grams'=>'Грам','Millimeters'=>'Міліметри','Inches'=>'Дюйми','Yards'=>'Ярди','Ounces'=>'Унції','Are you sure you want to remove the selected items?'=>'Ви впевнені, що хочете видалити вибрані елементи?','You may need to manually restore the item\'s stock.'=>'Вам може знадобитися вручну відновити запас товару.','Sud Sardegna'=>'Суд Сардинія','Cordillera'=>'Кордильєри','Presidente Hayes'=>'Пресіденте-Аєс','%d API key permanently revoked.'=>'%d API ключа скасовано без можливості відновлення.' . "\0" . '%d API ключа скасовано без можливості відновлення.' . "\0" . '%d API ключа скасовані без можливості відновлення.','Apartment, suite, unit, etc.'=>'Будинок, офіс, блок, тощо.','This action cannot be reversed. Are you sure you wish to erase personal data from the selected orders?'=>'Цю дію не можна скасувати. Ви впевнені, що хочете видалити особисті дані із вибраних замовлень?','Cannot set attributes due to invalid parent product.'=>'Не вдається встановити атрибути через недійсний батьківський товар.','Payer first name'=>'Ім\'я платника','Payer last name'=>'Прізвище платника','Shipping Address'=>'Адреса доставки','Billing Address'=>'Платіжна адреса','Payer PayPal address'=>'PayPal адресу платника','Shipping Address 1'=>'Адреса доставки 1','Billing Address 1'=>'Платіжна адреса 1','MySQL version string.'=>'Рядок версії MySQL.','Your CSV needs to include columns in a specific order. %1$sClick here to download a sample%2$s.'=>'Ваш CSV повинен включати стовпці в певному порядку. %1$sНатисніть тут, щоб завантажити зразок%2$s.','terms and conditions'=>'правила та умови','privacy policy'=>'політика конфіденційності','United States (US) dollar'=>'Сполучені Штати Америки (США) долар','PayPal allows us to send one address. If you are using PayPal for shipping labels you may prefer to send the shipping address rather than billing. Turning this option off may prevent PayPal Seller protection from applying.'=>'PayPal дозволяє нам надсилати одну адресу. Якщо ви використовуєте PayPal для доставки етикетки, ви можете відправити адресу відправлення, а не платіж. Вимкнення цього параметра може запобігти застосуванню захисту PayPal від продавця.','This will be how your name will be displayed in the account section and in reviews'=>'Так ваше ім\'я буде відображатися в розділі облікового запису та у відгуках','eCheck ending in %1$s'=>'eCheck закінчується на %1$s','%s page'=>'%s сторінка','Other locations'=>'Інші місця','%1$s &ndash; %2$s'=>'%1$s – %2$s','%1$s (#%2$s)'=>'%1$s (#%2$s)','Any &quot;%1$s&quot; method'=>'Будь-який &quot;%1$s&quot; метод','Account details:'=>'Деталі профілю:','No page set'=>'Сторінку не встановлено','I have read and agree to the website %s'=>'Я прочитав (а) і погоджуюся з правилами сайту %s','%s field'=>'%s поле','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'Ми приймаємо платежі через PayPal. Під час обробки платежів деякі Ваші дані будуть передані PayPal, включаючи інформацію, необхідну для обробки або підтримки платіжної інформації, таку як загальна вартість покупки та платіжна інформація.','PayPal Standard redirects customers to PayPal to enter their payment information.'=>'PayPal Standard перенаправляє клієнтів до PayPal, щоб ввести свою платіжну інформацію.','Take payments in person via checks. This offline gateway can also be useful to test purchases.'=>'Приймайте платежі особисто через чеки. Цей автономний шлюз також може бути корисним для тестування покупок.','These options let you change the appearance of the WooCommerce checkout.'=>'Ці параметри дозволяють змінити зовнішній вигляд Checkout WooCommerce.','Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>'Будь-ласка перегляньте це <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> для детальнішої інформації.','Comma-separated list of search stopwords in your languageabout,an,are,as,at,be,by,com,for,from,how,in,is,it,of,on,or,that,the,this,to,was,what,when,where,who,will,with,www'=>'а,без,би,в,де,для,так,до,за,і,із,або,до,як,коли,чи,на,над,ані,але,о,про,від,перед,по,під,при,про,з,у,крізь,аби','Optionally add some text for the terms checkbox that customers must accept.'=>'За потреби додайте текст умов, які повинні прийняти клієнти, поставивши галочку.','Highlight required fields with an asterisk'=>'Виділити обов\'язкові поля зірочкою','Required'=>'Обов’язкове','Take payments in person via BACS. More commonly known as direct bank/wire transfer.'=>'Приймайте платежі особисто через BACS, більш відомий як прямий банківський/електронний переказ.','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'В цьому розділі вам необхідно вказати, послугами яких сторонніх платіжних сервісів ви користуєтеся для прийому платежів у своєму магазині, так як ці сервіси можуть обробляти дані покупців. Ми навели відомості про використання PayPal як приклад. Якщо ви не користуєтеся послугами PayPal, цей текст необхідно видалити.','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'У цьому розділі слід вказувати з ким ви обмінюєтеся даними та з якою метою. Це може включати, наприклад, аналіз даних, маркетинг, платіжні шлюзи, постачальників послуг доставки та вбудованих об\'єктів сторонніх розробників.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Ми передаємо інформацію третім особам, які допомагають нам виконувати ваші замовлення та надавати послуги з продажу товарів. Наприклад --','What we share with others'=>'Чим ми ділимося','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Члени нашої команди мають доступ до цієї інформації, щоб допомогти виконати замовлення та підтримати вас.','Customer information like your name, email address, and billing and shipping information.'=>'Інформація про клієнтів - ваше ім\'я, адреса електронної пошти, а також інформація про розрахунки та доставку.','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Члени нашої команди мають доступ до інформації, яку ви надаєте нам. Наприклад, як адміністратори, так і менеджери магазинів можуть отримати доступ до:','Who on our team has access'=>'Хто з нашої команди має доступ','We will also store comments or reviews, if you choose to leave them.'=>'Ми також зберігатимемо коментарі чи відгуки, якщо ви вирішите залишити їх.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Інформацію про вас ми зберігаємо до того часу, поки вона нам потрібна . Наприклад, ми зберігатимемо інформацію про замовлення протягом XXX років для оподаткування та обліку. Це включає ваше ім\'я, адресу електронної пошти та адресу виставлення рахунків та доставки.','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Інформація про замовлення: що і коли було придбано та куди його потрібно надіслати, а також','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Якщо ви створите обліковий запис, ми збережемо ваше ім&#39;я, адресу, електронну адресу та номер телефону, які будуть використовуватися для заповнення замовлення на майбутні замовлення.','Send you marketing messages, if you choose to receive them'=>'Надсилати маркетингові повідомлення, якщо ви вирішите їх одержати','Comply with any legal obligations we have, such as calculating taxes'=>'Дотримуйтесь будь-яких юридичних зобов&#39;язань, які ми маємо, наприклад, обчислення податків','Process payments and prevent fraud'=>'Обробка платежів та запобігання шахрайству','Respond to your requests, including refunds and complaints'=>'Відповідайте на ваші запити, включаючи відшкодування та скарги','Send you information about your account and order'=>'Надсилати вам інформацію про ваш обліковий запис і замовлення','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Коли ви купуєте у нас, ми просимо вас надати інформацію, включаючи ваше ім&#39;я, платіжну адресу, адресу доставки, адресу електронної пошти, номер телефону, інформацію про кредитну картку / платіж та додаткову інформацію облікового запису, наприклад, ім&#39;я користувача та пароль. Ми використовуватимемо цю інформацію для таких цілей, як:','Set up your account for our store'=>'Налаштування вашого облікового запису для нашого магазину','Improve our store offerings'=>'Поліпшення пропозицій нашого магазину','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Ми також використовуватимемо файли cookie для відстеження вмісту кошика під час перегляду нашого сайту.','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Нотатка: Можливо, вам варто детально описати свою політику щодо файлів cookie та розмістити тут посилання на неї.','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Адреса доставки: ми попросимо Вас ввести це, щоб ми могли, наприклад, оцінити доставку, перш ніж розмістити замовлення, і надіслати Вам замовлення!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Місцезнаходження, IP-адреса та тип браузера: ми використовуватимемо це для цілей, як-от оцінити податки та доставку','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Товари, які ви переглядали: ми використаємо це, наприклад, щоб показати вам товари, які ви нещодавно переглядали','While you visit our site, we’ll track:'=>'Під час відвідування нашого сайту ми відслідковуємо:','What we collect and store'=>'Що ми збираємо та зберігаємо','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Цей зразок містить основні відомості про те, які персональні дані ваш магазин може збирати, зберігати та передавати третій стороні, а також про те, хто може отримати доступ до цих даних. Залежно від того, які налаштування ввімкнені та які додаткові плагіни використовуються, конкретна інформація, яка надається вашим магазином, буде відрізнятися. Ми радимо консультуватися з адвокатом, вирішуючи, яку інформацію розкривати у вашій політиці конфіденційності.','We collect information about you during the checkout process on our store.'=>'Ми збираємо інформацію про вас під час оформлення замовлення в нашому магазині.','Token'=>'Токен','Payment Tokens'=>'Платіжні токени','Access granted'=>'Доступ дозволено','Download count'=>'Кількість завантажень','User email'=>'Еmail користувача','Browser User Agent'=>'Агента браузера користувача','Order Number'=>'Номер замовлення','Items Purchased'=>'Придбані товари','Access to Purchased Downloads'=>'Доступ до придбаних завантажень','Customer Data'=>'Дані клієнта','Removed payment token "%d"'=>'Платіжний токен "%d" видалено','Personal data removed.'=>'Особисті дані видалено.','Customer download permissions have been retained.'=>'Права на завантаження клієнта збережені.','Removed