ce','%1$s - There is a newer version of WordPress available (%2$s)'=>'%1$s - Доступна нова версія WordPress (%2$s)','Settings tab labelPayments'=>'Платежі','Manage'=>'Керувати','WooCommerce version'=>'Версія WooCommerce','Enable coupons'=>'Увімкнути купони','Rates will be configurable and taxes will be calculated during checkout.'=>'Ціни будуть налаштовувані, а податки будуть розраховуватися під час оформлення замовлення.','Enable tax rates and calculations'=>'Увімкніть податкові ставки та розрахунки','Secure checkout'=>'Безпечне оформлення','Legacy API'=>'Застарілий API','Displays whether or not WordPress is using an external object cache.'=>'Відображає, чи використовує WordPress кеш зовнішнього об\'єкта.','External object cache'=>'Зовнішній кеш об\'єктів','WordPress cron'=>'WordPress cron','WordPress debug mode'=>'WordPress режим налагодження','WordPress memory limit'=>'WordPress ліміт пам\'яті','WordPress multisite'=>'WordPress мультисайт','WordPress version'=>'WordPress версія','Account endpoints'=>'Кінцеві точки облікового запису','Retain completed orders for a specified duration before anonymizing the personal data within them.'=>'Збережіть завершені замовлення на певну тривалість, перш ніж анонізувати особисті дані в них.','Retain cancelled orders'=>'Зберігати скасовані замовлення','Failed orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Невиконані замовлення не оплачуються, і, можливо, вони були залишені замовником. Вони будуть вивантажені після вказаної тривалості.','Retain completed orders'=>'Зберігати виконані замовлення','Retain failed orders'=>'Зберігати невиконані замовлення','Pending orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Замовлення, що очікують затвердження, не оплачені. Покупець може відмовитися від такого замовлення. Після завершення зазначеного періоду часу вони будуть видалені.','Cancelled orders are unpaid and may have been cancelled by the store owner or customer. They will be trashed after the specified duration.'=>'Скасовані замовлення не оплачуються та можуть бути скасовані власником магазину або замовником. Після закінчення зазначеного періоду часу вони будуть видалені.','Filter by registered customer'=>'Фільтр по ціні','Remove personal data'=>'Видалити особисті дані','Inactive accounts are those which have not logged in, or placed an order, for the specified duration. They will be deleted. Any orders will be converted into guest orders.'=>'Неактивні облікові записи - це ті, які не ввійшли або не розмістили замовлення на вказану тривалість. Вони будуть видалені. Будь-які замовлення будуть конвертовані в гостьові замовлення.','Personal data retention'=>'Збереження особистих даних','Account erasure requests'=>'Запити на видалення облікового запису','Use previous column mapping preferences?'=>'Використовувати попередні параметри відображення стовпців?','Retain inactive accounts '=>'Збереження неактивних облікових записів ','privacy page'=>'Сторінка політики конфіденційності','Removed personal data from %s order.'=>'Видалено особисті дані з %s замовлення.' . "\0" . 'Видалено особисті дані з %s замовлень.' . "\0" . 'Видалено особисті дані з %s замовлень.','Choose how long to retain personal data when it\'s no longer needed for processing. Leave the following options blank to retain this data indefinitely.'=>'Виберіть, як довго зберігати особисті дані, коли вони більше не потрібні для обробки. Залиште наступні опції порожніми, щоб зберегти ці дані на невизначений час.','Checkout privacy policy'=>'Політика конфіденційності оформлення замовлення','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'Ваші особисті дані будуть використані для підтримки вашого досвіду на цьому сайті, для управління доступом до вашого облікового запису та для інших цілей, описаних у нашій %s.','Registration privacy policy'=>'Політика конфіденційності реєстрації','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'Цей розділ керує відображенням політики конфіденційності вашого сайту. Наведені нижче повідомлення про конфіденційність не відображатимуться, якщо не встановлено %s.','Privacy policy'=>'Політика конфіденційності','Accounts &amp; Privacy'=>'Облікові записи та конфіденційність','Optionally add some text about your store privacy policy to show on account registration forms.'=>'За бажанням додайте текст про політику конфіденційності вашого магазину, щоб він відображався на реєстраційній формі облікового запису.','Optionally add some text about your store privacy policy to show during checkout.'=>'За бажанням додайте текст про політику конфіденційності вашого магазину, який буде показано під час оформлення замовлення.','Retain pending orders '=>'Зберігати очікувані замовлення ','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'Ваші персональні дані будуть використовуватися для обробки вашого замовлення, підтримки вашого досвіду на цьому сайті та для інших цілей, описаних у нашій %s.','List of allowed billing emails to check against when an order is placed. Separate email addresses with commas. You can also use an asterisk (*) to match parts of an email. For example "*@gmail.com" would match all gmail addresses.'=>'Перелік дозволених адрес електронної пошти для перевірки при оформленні замовлення. Розділяйте адреси електронної пошти комами. Ви також можете використовувати зірочку (*), щоб замінити частину адреси. Наприклад, "*@gmail.com" відповідатиме всім адресам gmail.','Allowed emails'=>'Дозволені Email\'и','You can also:'=>'Ви також можете:','View &amp; Customize'=>'Перегляд &amp; Налаштування','Visit Dashboard'=>'Перейти в Майстерню','Continue with 