> нову передплату або об&#39;єднати розширення на одній з підключених облікових записів, <strong><a href="%1$s" title="Обмін документами">поділившись</a> чи <a href="%2$s" title="Передавання документів">передавши</a></strong> це розширення на цей підключений обліковий запис.','M j, Y'=>'M j, Y','On-hold'=>'На утриманні','Change status to completed'=>'Змінити статус на "Виконано"','Change status to on-hold'=>'Змінити статус на "На утриманні"','Change status to processing'=>'Змінити статус на "В обробці"','Existing products that match by ID or SKU will be updated. Products that do not exist will be skipped.'=>'Існуючі товари, які відповідають ID або товарній одиниці, будуть оновлюватися. Товари, які не існують, будуть пропущені.','Payment via'=>'Спосіб оплати','The WooCommerce Helper plugin is no longer needed. <a href="%s">Manage subscriptions</a> from the extensions tab instead.'=>'Плагін WooCommerce Helper більше не потрібен. <a href="%s">Для керування підписками</a> переходьте на вкладку "Розширення".','Webhook topic unknown. Please select a valid topic.'=>'Тема Webhook невідома. Будь ласка, виберіть правильну тему.','Delete "%s" permanently'=>'Видалити "%s" назавжди','Continue with Jetpack'=>'Продовжуйте з Jetpack','payment setup'=>'установка платежу','payment setup and automated taxes'=>'налаштування платежів та автоматизовані податки','Reasons you\'ll love Jetpack'=>'Причини, чому вам сподобається Jetpack','Direct payments to email address:'=>'Прямі платежі на адресу електронної пошти:','Securely accept credit and debit cards with one low rate, no surprise fees (custom rates available). Sell online and in store and track sales and inventory in one place. <a href="%s" target="_blank">Learn more about Square</a>.'=>'Безпечно приймати кредитні та дебетові картки з однією низькою ставкою, без сюрпризів (доступні спеціальні тарифи). Продавайте в Інтернеті, а також зберігайте та відстежуйте продажі та інвентаризацію в одному місці. <a href="%s" target="_blank">Дізнайтеся більше про площу</a> .','Klarna Payments'=>'Klarna Payments','Klarna Checkout'=>'Klarna Checkout','Square'=>'Квадрат','Email address to receive payments'=>'E-mail адреса для отримання платежів','Choose the payment that you want, pay now, pay later or slice it. No credit card numbers, no passwords, no worries. <a href="%s" target="_blank">Learn more about Klarna</a>.'=>'Виберіть потрібний платіж, оплатіть відразу, пізніше або частинами. Ніяких номерів банківських карток, ніяких паролів, ніяких хвилювань. <a href="%s" target="_blank">Дізнайтеся більше про Klarna</a>.','Accept debit and credit cards in 135+ currencies, methods such as Alipay, and one-touch checkout with Apple Pay. <a href="%s" target="_blank">Learn more</a>.'=>'Прийміть дебетові та кредитні картки в 135 і більше валютах, таких як Alipay, і одноразовий виїзд із Apple Pay. <a href="%s" target="_blank">Дізнайтеся більше</a> .','Revision restored.'=>'Редакція відновлена.','I will also be selling products or services in person.'=>'Я також буду продавати товари або послуги особисто.','If you like, you may enter custom structures for your product URLs here. For example, using <code>shop</code> would make your product links like <code>%sshop/sample-product/</code>. This setting affects product URLs only, not things such as product categories.'=>'Якщо хочете, ви можете задати тут власну структуру посилань для товарів. Наприклад, якщо задати <code>shop</code> як основу посилання для товарів, то посилання ваших товарів виглядатимуть так: <code>%sshop/sample-product/</code>. Цей параметр впливає лише на URL-адреси товарів, а не на категорії товарів.','Customer downloads'=>'Завантаження покупців','Full checkout experience with pay now, pay later and slice it. No credit card numbers, no passwords, no worries. <a href="%s" target="_blank">Learn more about Klarna</a>.'=>'Повне оформлення замовлення при оплаті зараз, при оплаті пізніше і частинами. Ні номерів банківських карт, ні паролів, ні хвилювань. <a href="%s