ce.'=>'Новий метод оплати може бути доданий під час оформлення. Будь ласка, зв’яжіться з нами якщо ви потребуєте допомоги.','Belarusian ruble (old)'=>'Білоруський рубль (старий)','This key is invalid or has already been used. Please reset your password again if needed.'=>'Цей ключ недійсний або вже використовується. Поміняйте пароль ще раз, якщо це необхідно.','End date of sale price, as GMT.'=>'Кінцева дата ціни зі знижкою (час за Грінвічем).','Define if the variation is visible on the product\'s page.'=>'Визначте, чи варіант видно на сторінці товару.','Resend new order notification'=>'Повторити повідомлення про нове замовлення','Order updated and sent.'=>'Замовлення оновлене та надіслане.','A list of your store\'s top-rated products.'=>'Перелік товарів з найвищою оцінкою Вашого магазину.','A search form for your store.'=>'Форма пошуку Вашого магазину.','Recent Product Reviews'=>'Останні відгуки','A list of your store\'s products.'=>'Перелік товарів Вашого магазину.','Active Product Filters'=>'Активні фільтри','Please enter a valid email address'=>'Будь ласка, введіть правильний email','Unable to add payment method to your account.'=>'Неможливо додати метод оплати до вашого акаунту.','Create account password'=>'Створити пароль облікового запису','Please, provide an attribute name.'=>'Будь ласка, вкажіть ім\'я атрибута.','Sorry, the order could not be found. Please contact us if you are having difficulty finding your order details.'=>'На жаль, замовлення не знайдено. Будь ласка, зв\'яжіться з нами, якщо у вас виникли труднощі з пошуком деталей замовлення.','Sorry, "%s" is no longer in stock so this order cannot be paid for. We apologize for any inconvenience caused.'=>'На жаль, "%s" більше немає в наявності, тому це замовлення не можна оплатити. Вибачте за будь-які незручності.','%1$s was called with an invalid level "%2$s".'=>'%1$s викликано з неправильним рівнем "%2$s".','The provided handler %1$s does not implement %2$s.'=>'Заданий обробник %1$s не реалізує %2$s.