isplay the customer shopping cart.'=>'Відображення кошика покупця.','Create pages'=>'Створити сторінки','Create default WooCommerce pages'=>'Створити сторінки  WooCommerce за замовчуванням','Store Address'=>'Адреса магазину','Update now'=>'Оновити зараз','Plugin'=>'Плагін','unknown'=>'невідомий','%s fee'=>'%s комісія','This option will delete ALL of your tax rates, use with caution. This action cannot be reversed.'=>'Ця опція знищить всі ваші податкові ставки, використовуйте з обережністю. Цю дію не можна скасувати.','Delete tax rates'=>'Видалити податкові ставки','WooCommerce transients'=>'WooCommerce перехідні процеси','Database Index Size'=>'Розмір бази даних','%s failed. Contact your hosting provider.'=>'%s не вдалося. Зверніться до свого постачальника послуг хостингу.','The following active plugin(s) have not declared compatibility with WooCommerce %s yet and should be updated and examined further before you proceed:'=>'Наступні активні плагіни ще не оголосили сумісність із WooCommerce %s , і вони повинні бути оновлені та перевірені, перш ніж продовжити:','Tested up to WooCommerce version'=>'Тестовано до версії WooCommerce','Database Data Size'=>'Розмір бази даних','Total Database Size'=>'Загальний розмір бази даних','<strong>Heads up!</strong> The versions of the following plugins you\'re running haven\'t been tested with WooCommerce %s. Please update them or confirm compatibility before updating WooCommerce, or you may experience issues:'=>'<strong>Увага!</strong> Версії наступних плагінів, які ви використовуєте, не були протестовані з WooCommerce %s. Будь ласка, оновіть їх або підтвердьте сумісність, перш ніж оновлювати WooCommerce, або можуть виникнути проблеми:','The postal code, if any, in which your business is located.'=>'Поштовий індекс, якщо таке є, де знаходиться ваш бізнес.','The country and state or province, if any, in which your business is located.'=>'Країна та область або провінція, якщо така є, в якій знаходиться ваш бізнес.','Country / State'=>'Країна / область','The city in which your business is located.'=>'Місто, в якому знаходиться ваш бізнес.','The street address for your business location.'=>'Адреса вашого бізнесу.','Clear customer sessions'=>'Очистити сесії покупця','Page settingTerms and conditions'=>'Правила та умови','Post Type Counts'=>'Кількість типів записів','This is where your business is located. Tax rates and shipping rates will use this address.'=>'Місце де знаходиться ваш бізнес. Розрахунки податкової ставки та вартості доставки використовуватимуть цю адресу.','An additional, optional address line for your business location.'=>'Додатковий, необов\'язковий рядок адреси для місцезнаходження вашого бізнесу.','Forcing downloads will keep URLs hidden, but some servers may serve large files unreliably. If supported, %1$s / %2$s can be used to serve downloads instead (server requires %3$s).'=>'Примусове завантаження призведе до приховування URL-адрес, однак деякі сервери можуть служити великими файлами неналежним чином. Якщо підтримується, %1$s / %2$s може бути використаний для показу завантажень (сервер вимагає %3$s).','Choose an action...'=>'Виберіть дію...','Upload a new file'=>'Завантажте новий файл','The file is empty or using a different encoding than UTF-8, please try again with a new file.'=>'Файл порожній або використовується інше кодування, ніж UTF-8, будь ласка, спробуйте ще раз з новим файлом.','Refund #%1$s - %2$s by %3$s'=>'Повернення #%1$s - %2$s by %3$s','The stock has not been updated because the value has changed since editing. Product %1$d has %2$d units in stock.'=>'Запас не був оновлений, тому що значення змінилося з моменту редагування. У товарі %1$d наявні %2$d одиниці.','Lifetime Subscription'=>'Термін підписки','Add shipping'=>'Додати доставку','Sort by:'=>'Сортувати за:','Order details manually sent to customer.'=>'Деталі замовлення вручну надіслані покупцю.','Position'=>'Розташування','Send order details to customer'=>'Надіслати деталі замовлення покупцю','Below is a list of extensions available on your WooCommerce.com account. To receive extension updates please make sure the extension is installed, and its subscription activated and connected to your WooCommerce.com account. Extensions can be activated from the <a href="%s">Plugins</a> screen.'=>'Нижче наведено перелік розширень, доступних у вашому обліковому записі WooCommerce.com. Щоб отримувати оновлення для розширень, будь ласка, переконайтесь, що розширення встановлено, а його підписку активовано та підключено до вашого облікового запису WooCommerce.com. Розширення можна активувати на вкладці <a href="%s"> Плагіни</a>.','Expired'=>'Закінчився','If you like %1$s please leave us a %2$s rating. A huge thanks in advance!'=>'Якщо вам подобається %1$s, залиште нам оцінку %2$s. Величезне спасибі заздалегідь!','Expiring Soon'=>'Незабаром закінчується','Update Available'=>'Доступне оновлення','Transfer existing products to your new store — just import a CSV file.'=>'Передайте існуючі товари в новий магазин - просто імпортуйте файл CSV.','Import products'=>'Імпорт товарів','Create a product'=>'Створити товар','Have an existing store?'=>'Вже існуючий магазин?','Yes please!'=>'Так, будь ласка!','We\'re here for you — get tips, product updates, and inspiration straight to your mailbox.'=>'Ми тут для вас - отримуйте поради, оновлення товарів та натхнення прямо на свою поштову скриньку.','You\'re ready to start selling!'=>'Ви готові почати продавати!','Your site might be on a private network. Jetpack can only connect to public sites. Please make sure your site is visible over the internet, and then try connecting again 🙏.'=>'Ваш сайт може бути в приватній мережі. Jetpack може підключатися тільки до загальнодоступних сайтів. Будь ласка, переконайтеся, що ваш сайт є видимим через Інтернет, а потім спробуйте підключитися знову 🙏.','Sorry! We couldn\'t contact Jetpack just now 😭. Please make sure that your site is visible over the internet, and that it accepts incoming and outgoing requests via curl. You can also try to connect to Jetpack again, and if you run into any more issues, please contact support.'=>'Вибачте! Ми не могли зв\'язатися з Jetpack прямо зараз 😭. Будь ласка, переконайтеся, що ваш сайт є видимим через Інтернет, і він приймає вхідні та вихідні запити через curl. Ви також можете спробувати знову підключитися до Jetpack, і якщо ви зіткнетесь з будь-якими проблемами, зв\'яжіться зі службою підтримки.','Sorry! We tried, but we couldn\'t install Jetpack for you 😭. Please go to the Plugins tab to install it, and finish setting up your store.'=>'Вибачте! Ми спробували, але не змогли встановити Jetpack для вас. Перейдіть на вкладку Плагіни, щоб встановити його, і завершіть налаштування свого магазину.','Sorry! We tried, but we couldn\'t connect Jetpack just now 😭. Please go to the Plugins tab to connect Jetpack, so that you can finish setting up your store.'=>'Вибачте! Ми намагалися, але не змогли зараз підключити Jetpack 😭. Будь ласка, перейдіть на вкладку Плагіни, щоб під\'єднати Jetpack, щоб ви могли закінчити налаштування свого магазину.','Share new items on social media the moment they\'re live in your store.'=>'Діліться новими елементами в соціальних мережах, коли вони перебувають у вашому магазині.','Get an alert if your store is down for even a few minutes.'=>'Отримайте сповіщення, якщо ваш магазин не працює навіть кілька хвилин.','Store monitoring'=>'Моніторинг магазину','Product promotion'=>'Просування товару','Get insights on how your store is doing, including total sales, top products, and more.'=>'Дізнайтеся, як працює ваш магазин, включаючи загальний обсяг продажів, найпопулярніші товари тощо.','Finish setting up your store'=>'Завершіть налаштування свого магазину','Sorry, we couldn\'t connect your store to Jetpack'=>'На жаль, ми не змогли підключити ваш магазин до Jetpack','Store stats'=>'Статистика магазину','Protect your store from unauthorized access.'=>'Захистіть ваш магазин від несанкціонованого доступу.','Better secur