he description which the user sees during checkout.'=>'Опис, який користувач бачить під час оформлення замовлення.','Optionally enable "Payment Data Transfer" (Profile > Profile and Settings > My Selling Tools > Website Preferences) and then copy your identity token here. This will allow payments to be verified without the need for PayPal IPN.'=>'Опціонально можна включити "Передачу даних про оплату" (Профіль> Профіль і налаштування> Мої інструменти продажів> Установки сайту) і вставити ідентифікаційний маркер сюди. Це дозволить підтверджувати платежі без використання PayPal IPN.','Please enter a prefix for your invoice numbers. If you use your PayPal account for multiple stores ensure this prefix is unique as PayPal will not allow orders with the same invoice number.'=>'Будь ласка, введіть префікс для номерів рахунків. Якщо ви використовуєте ваш PayPal аккаунт для декількох магазинів, цей префікс повинен бути унікальним, оскільки PayPal не дозволить робити замовлення з тим же номером рахунку.','Address override'=>'Перевизначити адресу','Payment action'=>'Дія оплати','Choose whether you wish to capture funds immediately or authorize payment only.'=>'Виберіть, чи хочете ви отримувати кошти негайно або підтверджувати кожен платіж окремо.','Authorize'=>'Авторизація','API credentials'=>'API Повноваження','Get your API credentials from PayPal.'=>'Отримайте облікові дані API з PayPal.','Enter a cost (excl. tax) or sum, e.g. <code>10.00 * [qty]</code>.'=>'Введіть вартість (за викл. податків) або суму, наприклад <code>10.00 * [qty]</code>.','Supports the following placeholders: <code>[qty]</code> = number of items, <code>[cost]</code> = cost of items, <code>[fee percent="10" min_fee="20"]</code> = Percentage based fee.'=>'Підтримуються наступні заповнювачі: <code>[qty]</code> = кількість одиниць, <code>[cost]</code> = ціна одиниць, <code>[fee percent="10" min_fee="20"]</code> = Процентна комісія.','Method title'=>'Назва способу','Availability'=>'Доступність','Select some countries'=>'Оберіть країни','Shipping class costs'=>'Вартість класів доставки','Per class: Charge shipping for each shipping class individually'=>'За класом: Вартість доставки розраховується окремо за кожен клас в замовленні','Per order: Charge shipping for the most expensive shipping class'=>'За замовленням: Плата за доставку найдорожчого класу доставки','Method availability'=>'Доступність способу','A minimum order amount OR a coupon'=>'Мінімальна сума замовлення АБО купон','A minimum order amount AND a coupon'=>'Мінімальна сума замовлення ТА купон','Minimum order amount'=>'Мінімальна сума замовлення','How to calculate delivery charges'=>'Як обраховувати вартість доставки','Fixed amount'=>'Фіксована сума','Percentage of cart total'=>'Відсоток від підсумку кошика','What ZIP/post codes are available for local delivery?'=>'Які поштові індекси доступні для локальної доставки?','Welcome to {site_title}'=>'Вітаємо на {site_title}','Validation error: PayPal amounts do not match (gross %s).'=>'Помилка валідації: в PayPal суми не збігаються (брутто %s).','These rates are extra shipping options with additional costs (based on the flat rate).'=>'Додаткові опції доставки за додаткові кошти (базуючись на єдиній вартості доставки).','Fee type'=>'Тип збору','Delivery fee'=>'Збір за доставку','What fee do you want to charge for local delivery, disregarded if you choose free. Leave blank to disable.'=>'Який збір ви хочете застосувати до локальної доставки, ігноруйте, якщо ви вибрали безкоштовну. Залиште порожнім, щоб відключити.','Fixed amount per product'=>'Фіксована сума на товар','Capture'=>'Захоплення','Enable logging'=>'Включити ведення журналу','Invoice prefix'=>'Префікс рахунку','Reversal cancelled for order #%s'=>'Відміну платежу скасовано для замовлення  №%s','Enable for shipping methods'=>'Увімкнути для способів доставки','Accept COD if the order is virtual'=>'Дозволити оплату при отриманні для віртуальних замовлень','Payment to be made upon delivery.'=>'Оплата здійснюється по факту доставки.','Enable check payments'=>'Увімкнути оплату чеками','Enable bank transfer'=>'Увімкнути банківські перекази','Plain text template'=>'Шаблон простого тексту','New account'=>'Новий обліковий запис','Order #%s'=>'Замовлення №%s','Select shipping methods'=>'Оберіть способи доставки','Flat rate'=>'Єдиний тариф','Enter your PayPal API credentials to process refunds via PayPal. Learn how to access your <a href="%s">PayPal API Credentials</a>.'=>'Введіть облікові дані PayPal API для обробки повернень за допомогою PayPal. Дізнатися, як отримати доступ до <a href="%s">облікових даних PayPal API </a>.','These costs can optionally be added based on the <a href="%s">product shipping class</a>.'=>'Ці витрати опціонально можуть бути додані на основі <a href="%s">класу доставки товару</a>.','Enable PayPal Standard'=>'Увімкнути PayPal Standard','Debug log'=>'Журнал відлагодження','This template has been overridden by your theme and can be found in: %s.'=>'Цей шаблон був перевизначений вашою темою і його можна знайти тут: %s.','Sort code'=>'Sort код','Bank transit number'=>'Банківський транзитний номер','Payment pending (%s).'=>'Очікування оплати: (%s).','Receiver email'=>'Email отримувача','Order #%1$s has had a reversal cancelled. Please check the status of payment and update the order status accordingly here: %2$s'=>'Замовлення №%1$s було анульовано. Будь ласка, перевірте статус платежу та оновіть статус замовлення тут: %2$s','Order #%1$s has been marked as refunded - PayPal reason code: %2$s'=>'Замовлення №%1$s було позначено як відшкодоване — код причини в PayPal: %2$s','Refunded %1$s - Refund ID: %2$s'=>'Відшкодовано %1$s - Номер відшкодування: %2$s','Make your payment directly into our bank account. Please use your Order ID as the payment reference. Your order will not be shipped until the funds have cleared in our account.'=>'Проведіть платіж безпосередньо на наш банківський рахунок. Будь ласка, вкажіть номер Вашого замовлення в описі переказу. Ваше замовлення не буде виконано, доки кошти не будуть зараховані на наш рахунок.','Separate codes with a comma. Accepts wildcards, e.g. <code>P*</code> will match a postcode of PE30. Also accepts a pattern, e.g. <code>NG1___</code> would match NG1 1AA but not NG10 1AA'=>'Розділяйте коди комою. Дозволені знаки підстановки, наприклад: <code>P*</code> буде відповідати поштовому індексу PE30. Також допустимі шаблони, наприклад: <code>NG1___</code> буде відповідати NG1 1AA, але не NG10 1AA','[Order #%s]'=>'[Замовлення #%s]','Allowed ZIP/post codes'=>'Дозволені поштові індекси','Failed <span class="count">(%s)</span>'=>'Невдалі <span class="count">(%s)</span>' . "\0" . 'Невдалі <span class="count">(%s)</span>' . "\0" . 'Невдалі <span class="count">(%s)</span>','Order #%1$s has been marked on-hold due to a reversal - PayPal reason code: %2$s'=>'Замовлення №%1$s було позначено "На утриманні" через відміну платежу - код причини PayPal: %2$s','Validation error: PayPal IPN response from a different email address (%s).'=>'Помилка валідації: IPN відповідь PayPal з іншого електронного листа (%s).','Direct bank transfer'=>'Банківський переказ','New order emails are sent to chosen recipient(s) when a new order is received.'=>'Електронний лист "Нове замовлення" надсилається одержувачам з переліку, коли надходить нове замовлення.','Partial refund email heading'=>'Заголовок електронного листа про часткове повернення','Full refund email heading'=>'Заголовок електронного листа про повне повернення','Partial refund subject'=>'Тема електронного листа про часткове відшкодування','Full refund subject'=>'Тема електронного листа про повне відшкодування','A note has been added to your order'=>'До вашого замовлення було додано нотатку','Note added to your {site_title} order from {order_date}'=>'Додано нотатку до вашого замовлення від {order_date} на {site_title}','Email heading (paid)'=>'Заголовок електронного листа (Оплачено)','Choose which format of email to send.'=>'Оберіть, у якому форматі буде надси