e already exists'=>'Код купону вже існує','L/W/H'=>'Д/Ш/В','Visibility'=>'Видимість','In stock?'=>'В наявності?','Page settingCheckout'=>'Оформлення замовлення','WordPress environment'=>'Середовище WordPress','The version of WooCommerce installed on your site.'=>'Версія встановленого на вашому сайті WooCommerce.','Log directory writable'=>'Права на запис у каталог журналів','Several WooCommerce extensions can write logs which makes debugging problems easier. The directory must be writable for this to happen.'=>'Деякі розширення WooCommerce можуть писати журнали, що полегшує налагодження проблем. Каталог повинен бути доступний для запису, якщо таке відбудеться.','Whether or not you have WordPress Multisite enabled.'=>'Чи задіяно функцію мультисайту у вашому WordPress.','The maximum amount of memory (RAM) that your site can use at one time.'=>'Максимальний обсяг пам\'яті (ОЗУ), яку ваш сайт може використовувати одночасно.','Server environment'=>'Середовище сервера','PHP max input vars'=>'PHP Max Input Vars','The maximum number of variables your server can use for a single function to avoid overloads.'=>'Максимальна кількість змінних, яку ваш сервер може використовувати для однієї функції, щоб уникнути перевантажень.','SUHOSIN installed'=>'SUHOSIN встановлено','Suhosin is an advanced protection system for PHP installations. It was designed to protect your servers on the one hand against a number of well known problems in PHP applications and on the other hand against potential unknown vulnerabilities within these applications or the PHP core itself. If enabled on your server, Suhosin may need to be configured to increase its data submission limits.'=>'Suhosin є передовою системою захисту PHP. Він був розроблений для захисту серверів, з одного боку, відносно ряду добре відомих проблем в PHP-додатках, а з іншого боку, від потенційних вразливостей, невідомих у цих додатках, або самого ядра PHP. Якщо Suhosin включено на вашому сервері, можливо, потрібна бути налаштована збільшена межа дозволених даних.','The version of MySQL installed on your hosting server.'=>'Версія MySQL, яку встановлено на сервері вашого хостингу.','Payment gateways can use cURL to communicate with remote servers to authorize payments, other plugins may also use it when communicating with remote services.'=>'Платіжні шлюзи можуть використовувати cURL для зв\'язку з віддаленими серверами під час авторизації платежів. Інші плагіни також можуть використовувати його для зв\'язку з віддаленими сервісами.','Some webservices like shipping use SOAP to get information from remote servers, for example, live shipping quotes from FedEx require SOAP to be installed.'=>'Деякі веб-сервіси, такі як доставка, використовують SOAP, щоб отримати інформацію від віддалених серверів, наприклад, відстеження доставки від FedEx, вимагають встановлення SOAP.','GZip (gzopen) is used to open the GEOIP database from MaxMind.'=>'GZip (gzopen) використовується для відкриття бази даних GeoIP від MaxMind.','PayPal uses this method of communicating when sending back transaction information.'=>'PayPal використовує цей спосіб зв\'язку для повернення інформації про транзакцію.','Table does not exist'=>'Таблиця не існує','Force SSL'=>'Примусовий SSL','What currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'У якій валюті виводяться ціни в каталозі і в якій валюті платіжні шлюзи будуть приймати оплату.','Page not set'=>'Сторінку не встановлено','%s is available'=>'%s доступно','The parent theme developers URL.'=>'URL розробника батьківської теми.','Displays whether or not the current active theme declares WooCommerce support.'=>'Показує, чи підтримує поточна тема WooCommerce.','Not declared'=>'Не визначено','Templates'=>'Шаблони','Overrides'=>'Перевизначення','Tools'=>'Інструменти','Logs'=>'Журнали','Sold individually?'=>'Продавати окремо?','Placeholder'=>'Заповнювач','Deleted %s'=>'%s видалено','This section shows any files that are overriding the defaul