lt timezone is %s - it should be UTC'=>'Початкова часова зона %s — повинна бути UTC','Information about the web server that is currently hosting your site.'=>'Інформація про вебсервер, на якому розміщено ваш сайт.','The current language used by WordPress. Default = English'=>'Поточна мова, що використовується WordPress. Початкова = English','Displays whether or not WordPress is in Debug Mode.'=>'Відображає, чи знаходиться WordPress в режимі налагодження.','Page settingShop base'=>'Головна сторінка магазина','Remote get'=>'Віддалений запит GET','Page settingMy account'=>'Мій обліковий запис','Displays whether or not the current theme is a child theme.'=>'Показує, чи є поточна тема дочірньою.','Average rating'=>'Середня оцінка','Currency'=>'Валюта','Order received'=>'Замовлення отримано','Ship to all countries'=>'Доставляти в усі країни','Free'=>'Безкоштовно','Coupons can be applied from the cart and checkout pages.'=>'Купони можуть бути застосовані на сторінках кошика і оформлення замовлення.','Calculate coupon discounts sequentially'=>'Розраховувати знижки купонів послідовно','When applying multiple coupons, apply the first coupon to the full price and the second coupon to the discounted price and so on.'=>'При використанні декількох купонів, застосовувати перший купон до повної вартості, другий купон до вже зниженої і так далі.','Force secure checkout'=>'Примусовий режим безпеки при оформленні замовлення','Force HTTP when leaving the checkout'=>'Примусово використовувати HTTP після оформлення замовлення','Cart page'=>'Сторінка кошика','Endpoints are appended to your page URLs to handle specific actions during the checkout process. They should be unique.'=>'Кінцеві точки додаються до URL-адреси вашої сторінки для обробки конкретних дій у процесі оформлення замовлення. Вони повинні бути унікальними.','Pay'=>'Оплатити','Add payment method'=>'Додати спосіб оплати','This option lets you limit which countries you are willing to sell to.'=>'Ця опція дозволяє обмежити кр